    "DARTARS": "A kind of scab or ulceration on the skin of lambs.",
    "DARTER": "The snakebird, a water bird of the genus Plotus; -- so calledbecause it darts out its long, snakelike neck at its prey. SeeSnakebird.",
    "DARTINGLY": "Like a dart; rapidly.",
    "DARTLE": "To pierce or shoot through; to dart repeatedly: --frequentative of dart.My star that dartles the red and the blue. R. Browning.",
    "DARTOIC": "Of or pertaining to the dartos.",
    "DARTOID": "Like the dartos; dartoic; as, dartoid tissue.",
    "DARTOS": "A thin layer of peculiar contractile tissue directly beneaththe skin of the scrotum.",
    "DARTROUS": "Relating to, or partaking of the nature of, the disease calledtetter; herpetic. Dartroud diathesis, A morbid condition of thesystem predisposing to the development of certain skin deseases, suchas eczema, psoriasis, and pityriasis. Also called rheumic diathesis,and hipretism. Piffard.",
    "DARWINIAN": "Pertaining to Darwin; as, the Darwinian theory, a theory of themanner and cause of the supposed development of living things fromcertain original forms or elements.",
    "DARWINIANISM": "Darwinism.",
    "DARWINISM": "The theory or doctrines put forth by Darwin. See above. Huxley.",
    "DASE": "See Daze. [Obs.] Chaucer.",
    "DASEWE": "To become dim-sighted; to become dazed or dazzled. [Obs.]Chauscer.",
    "DASH": "To rust with violence; to move impetuously; to strikeviolently; as, the waves dash upon rocks.[He] dashed through thick and thin. Dryden.On each hand the gushing waters play, And down the rough cascade alldashing fall. Thomson.",
    "DASHEEN": "A tropical aroid (of the genus Caladium, syn. Colocasia) havingan edible farinaceous root. It is related to the taro and to thetanier, but is much superior to it in quality and is as easily cookedas the potato. It is a staple food plant of the tropics, beingprepared like potatoes, and has been introduced into the SouthernUnited States.",
    "DASHING": "Bold; spirited; showy.The dashing and daring spirit is preferable to the listless. T.Campbell.",
    "DASHINGLY": "Conspicuously; showily. [Colloq.]A dashingly dressed gentleman. Hawthorne.",
    "DASHISM": "The character of making ostentatious or blustering parade orshow. [R. & Colloq.]He must fight a duel before his claim to . . . dashism can beuniversally allowed. V. Knox.",
    "DASHPOT": "A pneumatic or hydraulic cushion for a falling weight, as inthe valve gear of a steam engine, to prevent shock.",
    "DASHY": "Calculated to arrest attention; ostentatiously fashionable;showy. [Colloq.]",
    "DASTARD": "One who meanly shrinks from danger; an arrant coward; apoltroon.You are all recreants and dashtards, and delight to live in slaveryto the nobility. Shak.",
    "DASTARDIZE": "To make cowardly; to intimidate; to dispirit; as, to dastardizemy courage. Dryden.",
    "DASTARDLINESS": "The quality of being dastardly; cowardice; base fear.",
    "DASTARDLY": "Meanly timid; cowardly; base; as, a dastardly outrage.",
    "DASTARDNESS": "Dastardliness.",
    "DASTARDY": "Base timidity; cowardliness.",
    "DASWE": "See Dasewe [Obs.] Chaucer.",
    "DASYMETER": "An instrument for testing the density of gases, consisting of athin glass globe, which is weighed in the gas or gases, and then inan atmosphere of known density.",
    "DASYPAEDAL": "Dasypædic.",
    "DASYPAEDES": "Those birds whose young are covered with down when hatched.",
    "DASYPAEDIC": "Pertaining to the Dasypædes; ptilopædic.",
    "DASYURE": "A carnivorous marsupial quadruped of Australia, belonging tothe genus Dasyurus. There are several species.",
    "DASYURINE": "Pertaining to, or like, the dasyures.",
    "DATA": "See Datum.",
    "DATABLE": "That may be dated; having a known or ascertainable date.\"Datable almost to a year.\" The Century.",
    "DATARIA": "Formerly, a part of the Roman chancery; now, a separate officefrom which are sent graces or favors, cognizable in foro externo,such as appointments to benefices. The name is derived from the worddatum, given or dated (with the indications of the time and place ofgranting the gift or favor).",
    "DATARY": "An officer in the pope's court, having charge of the Dataria.",
    "DATE": "The fruit of the date palm; also, the date palm itself.",
    "DATE LINE": "The hypothetical line on the surface of the earth fixed byinternational or general agreement as a boundary on one side of whichthe same day shall have a different name and date in the calendarfrom its name and date on the other side.",
    "DATELESS": "Without date; having no fixed time.",
    "DATER": "One who dates.",
    "DATISCIN": "A white crystalline glucoside extracted from the bastard hemp(Datisca cannabina).",
    "DATIVE": "Noting the case of a noun which expresses the remoter object,and is generally indicated in English by to or for with theobjective.",
    "DATIVELY": "As a gift. [R.]",
    "DATOLITE": "A borosilicate of lime commonly occuring in glassy,, greenishcrystals. [Written also datholite.]",
    "DATUM": "The quantities or relations which are assumed to be given inany problem. Datum line (Surv.), the horizontal or base line, fromwhich the heights of points are reckoned or measured, as in the planof a railway, etc.",
    "DATURA": "A genus of solanaceous plants, with large funnel-shaped flowersand a four-celled, capsular fruit.",
    "DATURINE": "Atropine; -- called also daturia and daturina.",
    "DAUB": "To smear; to play the flatterer.His conscience . . . will not daub nor flatter. South.",
    "DAUBER": "A pad or ball of rags, covered over with canvas, for inkingplates; a dabber.",
    "DAUBREELITE": "A sulphide of chromium observed in some meteoric irons.",
    "DAUBY": "Smeary; viscous; glutinous; adhesive. \"Dauby wax.\"",
    "DAUGHTER-IN-LAW": "The wife of one's son.",
    "DAUGHTERLINESS": "The state of a daughter, or the conduct becoming a daughter.",
    "DAUGHTERLY": "Becoming a daughter; filial.Sir Thomas liked her natural and dear daughterly affection towardshim. Cavendish.",
    "DAUK": "See Dawk, v. t., to cut or gush.",
    "DAUN": "A variant of Dan, a title of honor. [Obs.] Chaucer.",
    "DAUNTER": "One who daunts.",
    "DAUNTLESS": "Incapable of being daunted; undaunted; bold; fearless;intrepid.Dauntless he rose, and to the fight returned. Dryden.-- Daunt\"less*ly, adv.-- Daunt\"less*ness, n.",
    "DAUPHIN": "The title of the eldest son of the king of France, and heir tothe crown. Since the revolution of 1830, the title has beendiscontinued.",
    "DAUW": "The striped quagga, or Burchell's zebra, of South Africa(Asinus Burchellii); -- called also peechi, or peetsi.",
    "DAVENPORT": "A kind of small writing table, generally somewhat ornamental,and forming a piece of furniture for the parlor or boudoir.A much battered davenport in one of the windows, at which sat a ladywriting. A. B. Edwards.",
    "DAVIDIC": "Of or pertaining to David, the king and psalmist of Israel, orto his family.",
    "DAVIT": "Curved arms of timber or iron, projecting over a ship's side ofstern, having tackle to raise or lower a boat, swing it in on deck,rig it out for lowering, etc.; -- called also boat davits. Totten.",
    "DAVY JONES": "The spirit of the sea; sea devil; -- a term used by sailors.This same Davy Jones, according to the mythology of sailors, is thefiend that presides over all the evil spirits of the deep, and isseen in various shapes warning the devoted wretch of death and woe.Smollett.Davy Jones's Locker, the ocean, or bottom of the ocean.-- Gone to Davy Jones's Locker, dead, and buried in the sea; thrownoverboard.",
    "DAVY LAMP": "See Safety lamp, under Lamp.",
    "DAVYNE": "A variety of nephelite from Vesuvius.",
    "DAVYUM": "A rare metallic element found in platinum ore. It is a whitemalleable substance. Symbol Da. Atomic weight 154.",
    "DAW": "A European bird of the Crow family (Corvus monedula), oftennesting in church towers and ruins; a jackdaw.The loud daw, his throat displaying, draw The whole assembly of hisfellow daws. Waller.",
    "DAWDLE": "To waste time in trifling employment; to trifle; to saunter.Come some evening and dawdle over a dish of tea with me. Johnson.We . . . dawdle up and down Pall Mall. Thackeray.",
    "DAWDLER": "One who wastes time in trifling employments; an idler; atrifler.",
    "DAWE": "Day. [Obs.] Chaucer.",
    "DAWISH": "Like a daw.",
    "DAWK": "See Dak.",
    "DAWSONITE": "A hydrous carbonate of alumina and soda, occuring in white,bladed crustals.",
    "DAY-COAL": "The upper stratum of coal, as nearest the light or surface.",
    "DAY-LABOR": "Labor hired or performed by the day. Milton.",
    "DAY-LABORER": "One who works by the day; -- usually applied to a farm laborer,or to a workman who does not work at any particular trade. Goldsmith.",
    "DAY-NET": "A net for catching small birds.",
    "DAY-PEEP": "The dawn. [Poetic] Milton.",
    "DAYAKS": "See Dyaks.",
    "DAYBOOK": "A journal of accounts; a primary record book in which arerecorded the debts and credits, or accounts of the day, in theirorder, and from which they are transferred to the journal.",
    "DAYBREAK": "The time of the first appearance of light in the morning.",
    "DAYDREAM": "A vain fancy speculation; a reverie; a castle in the air;unfounded hope.Mrs. Lambert's little daydream was over. Thackeray.",
    "DAYDREAMER": "One given to draydreams.",
    "DAYFLOWER": "A genus consisting mostly of tropical perennial herbs(Commelina), having ephemeral flowers.",
    "DAYFLY": "A neuropterous insect of the genus Ephemera and related genera,of many species, and inhabiting fresh water in the larval state; theephemeral fly; -- so called because it commonly lives but one day inthe winged or adult state. See Ephemeral fly, under Ephemeral.",
    "DAYLIGHT": "The eyes. [Prov. Eng.] Wright.",
    "DAYMAID": "A dairymaid. [Obs.]",
    "DAYMARE": "A kind of incubus which occurs during wakefulness, attended bythe peculiar pressure on the chest which characterizes nightmare.Dunglison.",
    "DAYSMAN": "An umpire or arbiter; a mediator.Neither is there any daysman betwixt us. Job ix. 33.",
    "DAYSPRING": "The beginning of the day, or first appearance of light; thedawn; hence, the beginning. Milton.The tender mercy of our God; whereby the dayspring from on high hathvisited us. Luke i. 78.",
    "DAYTIME": "The time during which there is daylight, as distinguished fromthe night.",
    "DAYWOMAN": "A dairymaid. [Obs.]",
    "DAZE": "To stupefy with excess of light; with a blow, with cold, orwith fear; to confuse; to benumb.While flashing beams do daze his feeble eyen. Spenser.Such souls, Whose sudden visitations daze the world. Sir H. Taylor.He comes out of the room in a dazed state, that is an odd though asufficient substitute for interest. Dickens.",
    "DAZZLE": "A light of dazzling brilliancy.",
    "DAZZLEMENT": "Dazzling flash, glare, or burst of light. Donne.",
    "DAZZLINGLY": "In a dazzling manner.",
    "DE BENE ESSE": "Of well being; of formal sufficiency for the time;conditionally; provisionally. Abbott.",
    "DE FACTO": "Actually; in fact; in reality; as, a king de facto, --distinguished from a king de jure, or by right.",
    "DE JURE": "By right; of right; by law; -- often opposed to be facto.",
    "DE RIGUEUR": "According to strictness (of etiquette, rule, or the like);obligatory; strictly required.",
    "DE-": "A prefix from Latin de down, from, away; as in debark, decline,decease, deduct, decamp. In words from the French it is equivalent toLatin dis- apart, away; or sometimes to de. Cf. Dis-. It is negativeand opposite in derange, deform, destroy, etc. It is intensive indeprave, despoil, declare, desolate, etc.",
    "DEACON": "An officer in Christian churches appointed to perform certainsubordinate duties varying in different communions. In the RomanCatholic and Episcopal churches, a person admitted to the lowestorder in the ministry, subordinate to the bishops and priests. InPresbyterian churches, he is subordinate to the minister and elders,and has charge of certain duties connected with the communion serviceand the care of the poor. In Congregational churches, he issubordinate to the pastor, and has duties as in the Presbyterianchurch.",
    "DEACONESS": "A female deacon; as:(a) (Primitive Ch.) One of an order of women whose duties resembledthose of deacons. (b) (Ch. of Eng. and Prot. Epis. Ch.)",
    "DEACONHOOD": "The state of being a deacon; office of a deacon; deaconship.",
    "DEACONRY": "See Deaconship.",
    "DEACONSHIP": "The office or ministry of a deacon or deaconess.",
    "DEAD": "Cut off from the rights of a citizen; deprived of the power ofenjoying the rights of property; as, one banished or becoming a monkis civilly dead.",
    "DEAD BEAT": "See Beat, n., 7. [Low, U.S.]",
    "DEAD-EYE": "A round, flattish, wooden block, encircled by a rope, or aniron band, and pierced with three holes to receive the lanyard; --used to extend the shrouds and stays, and for other purposes. Calledalso deadman's eye. Totten.",
    "DEAD-PAY": "Pay drawn for soldiers, or others, really dead, whose names arekept on the rolls.O you commanders, That, like me, have no dead-pays. Massinger.",
    "DEAD-RECKONING": "See under Dead, a.",
    "DEAD-STROKE": "Making a stroke without recoil; deadbeat. Dead-stroke hammer(Mach.), a power hammer having a spring interposed between thedriving mechanism and the hammer head, or helve, to lessen the recoilof the hammer and reduce the shock upon the mechanism.",
    "DEADBEAT": "Making a beat without recoil; giving indications by a singlebeat or excursion; -- said of galvanometers and other instruments inwhich the needle or index moves to the extent of its deflection andstops with little or no further oscillation. Deadbeat escapement. Seeunder Escapement.",
    "DEADBORN": "Stillborn. Pope.",
    "DEADENER": "One who, or that which, deadens or checks.",
    "DEADHEAD": "A buoy. See under Dead, a.",
    "DEADHOUSE": "A morgue; a place for the temporary reception and exposure ofdead bodies.",
    "DEADISH": "Somewhat dead, dull, or lifeless; deathlike.The lips put on a deadish paleness. A. Stafford.",
    "DEADLATCH": "A kind of latch whose bolt may be so locked by a detent that itcan not be opened from the inside by the handle, or from the outsideby the latch key. Knight.",
    "DEADLIGHT": "A strong shutter, made to fit open ports and keep out water ina storm.",
    "DEADLIHOOD": "State of the dead. [Obs.]",
    "DEADLINESS": "The quality of being deadly.",
    "DEADNESS": "The state of being destitute of life, vigor, spirit, activity,etc.; dullness; inertness; languor; coldness; vapidness;indifference; as, the deadness of a limb, a body, or a tree; thedeadness of an eye; deadness of the affections; the deadness of beeror cider; deadness to the world, and the like.",
    "DEADS": "The substances which inclose the ore on every side.",
    "DEADWOOD": "A mass of timbers built into the bow and stern of a vessel togive solidity.",
    "DEADWORKS": "The parts of a ship above the water when she is laden.",
    "DEAF": "To deafen. [Obs.] Dryden.",
    "DEAF-MUTE": "A person who is deaf and dumb; one who, through deprivation ordefect of hearing, has either failed the acquire the power of speech,or has lost it. [See Illust. of Dactylology.]Deaf-mutes are still so called, even when, by artificial methods,they have been taught to speak imperfectly.",
    "DEAF-MUTISM": "The condition of being a deaf-mute.",
    "DEAFEN": "To render impervious to sound, as a partition or floor, byfilling the space within with mortar, by lining with paper, etc.",
    "DEAFENING": "The act or process of rendering impervious to sound, as a flooror wall; also, the material with which the spaces are filled in thisprocess; pugging.",
    "DEAFLY": "Without sense of sounds; obscurely.",
    "DEAL": "The division of a piece of timber made by sawing; a board orplank; particularly, a board or plank of fir or pine above seveninches in width, and exceeding six feet in length. If narrower thanthis, it is called a batten; if shorter, a deal end.",
    "DEALBATE": "To whiten. [Obs.] Cockeram.",
    "DEALBATION": "Act of bleaching; a whitening. [Obs.]",
    "DEALFISH": "A long, thin fish of the arctic seas (Trachypterus arcticus).",
    "DEALING": "The act of one who deals; distribution of anything, as of cardsto the players; method of business; traffic; intercourse;transaction; as, to have dealings with a person. Double dealing,insincere, treacherous dealing; duplicity.-- Plain dealing, fair, sincere, honorable dealing; honest,outspoken expression of opinion.",
    "DEALTH": "Share dealt. [Obs.]",
    "DEAMBULATE": "To walk abroad. [Obs.] Cockeram.",
    "DEAMBULATION": "A walking abroad; a promenading. [Obs.] Sir T. Elyot.",
    "DEAMBULATORY": "Going about from place to place; wandering; of or pertaining toa deambulatory. [Obs.] \"Deambulatory actors.\" Bp. Morton.",
    "DEANSHIP": "The office of a dean.I dont't value your deanship a straw. Swift.",
    "DEAR": "A dear one; lover; sweetheart.That kiss I carried from thee, dear. Shak.",
    "DEAR-BOUGHT": "Bought at a high price; as, dear-bought experience.",
    "DEAR-LOVED": "Greatly beloved. Shak.",
    "DEARBORN": "A four-wheeled carriage, with curtained sides.",
    "DEARE": "variant of Dere, v. t. & n. [Obs.]",
    "DEARIE": "Same as Deary. Dickens.",
    "DEARLING": "A darling. [Obs.] Spenser.",
    "DEARN": "Secret; lonely; solitary; dreadful. [Obs.] Shak.-- Dearn\"ly, adv. [Obs.] Chaucer.",
    "DEARTH": "Scarcity which renders dear; want; lack; specifically, lack offood on account of failure of crops; famine.There came a dearth over all the land of Egypt. Acts vii. 11.He with her press'd, she faint with dearth. Shak.Dearth of plot, and narrowness of imagination. Dryden.",
    "DEARTICULATE": "To disjoint.",
    "DEARWORTH": "Precious. [Obs.] Piers Plowman.",
    "DEARY": "A dear; a darling. [Familiar]",
    "DEAS": "See Dais. [Scot.]",
    "DEATH": "Loss of spiritual life.To be death. Rom. viii. 6.",
    "DEATHBED": "The bed in which a person dies; hence, the closing hours oflife of one who dies by sickness or the like; the last sickness.That often-quoted passage from Lord Hervey in which the Queen'sdeathbed is described. Thackeray.",
    "DEATHBIRD": "Tengmalm's or Richardson's owl (Nyctale Tengmalmi); -- socalled from a superstition of the North American Indians that itsnote presages death.",
    "DEATHBLOW": "A mortal or crushing blow; a stroke or event which kills ordestroys.The deathblow of my hope. Byron.",
    "DEATHFULNESS": "Appearance of death. Jer. Taylor.",
    "DEATHLESS": "Not subject to death, destruction, or extinction; immortal;undying; imperishable; as, deathless beings; deathless fame.",
    "DEATHLINESS": "The quality of being deathly; deadliness. Southey.",
    "DEATHLY": "Deadly; fatal; mortal; destructive.",
    "DEATHSMAN": "An executioner; a headsman or hangman. [Obs.] Shak.",
    "DEATHWARD": "Toward death.",
    "DEAURATE": "Gilded. [Obs.]",
    "DEAURATION": "Act of gilding. [Obs.]",
    "DEAVE": "To stun or stupefy with noise; to deafen. [Scot.]",
    "DEBACCHATE": "To rave as a bacchanal. [R.] Cockeram.",
    "DEBACCHATION": "Wild raving or debauchery. [R.] Prynne.",
    "DEBACLE": "A breaking or bursting forth; a violent rush or flood of waterswhich breaks down opposing barriers, and hurls forward and dispersesblocks of stone and other débris.",
    "DEBAR": "To cut off from entrance, as if by a bar or barrier; topreclude; to hinder from approach, entry, or enjoyment; to shut outor exclude; to deny or refuse; -- with from, and sometimes with of.Yet not so strictly hath our Lord imposed Labor, as to debar us whenwe need Refreshment. Milton.Their wages were so low as to debar them, not only from the comfortsbut from the common decencies of civilized life. Buckle.",
    "DEBARB": "To deprive of the beard. [Obs.] Bailey.",
    "DEBARK": "To go ashore from a ship or boat; to disembark; to put ashore.",
    "DEBARKATION": "Disembarkation.The debarkation, therefore, had to take place by small steamers. U.S. Grant.",
    "DEBARMENT": "Hindrance from approach; exclusion.",
    "DEBARRASS": "To disembarrass; to relieve. [R.]",
    "DEBASE": "To reduce from a higher to a lower state or grade of worth,dignity, purity, station, etc.; to degrade; to lower; to deteriorate;to abase; as, to debase the character by crime; to debase the mind byfrivolity; to debase style by vulgar words.The coin which was adulterated and debased. Hale.It is a kind of taking God's name in vain to debase religion withsuch frivolous disputes. Hooker.And to debase the sons, exalts the sires. Pope.",
    "DEBASED": "Turned upside down from its proper position; inverted;reversed.",
    "DEBASEMENT": "The act of debasing or the state of being debased. Milton.",
    "DEBASER": "One who, or that which, debases.",
    "DEBASINGLY": "In a manner to debase.",
    "DEBATABLE": "Liable to be debated; disputable; subject to controversy orcontention; open to question or dispute; as, a debatable question.The Debatable Land or Ground, a tract of land between the Esk and theSark, claimed by both England and Scotland; the Batable Ground.",
    "DEBATEFUL": "Full of contention; contentious; quarrelsome. [Obs.] Spenser.",
    "DEBATEFULLY": "With contention. [Obs.]",
    "DEBATEMENT": "Controversy; deliberation; debate. [R.]A serious question and debatement with myself. Milton.",
    "DEBATER": "One who debates; one given to argument; a disputant; acontrovertist.Debate where leisure serves with dull debaters. Shak.",
    "DEBATING": "The act of discussing or arguing; discussion. Debating societyor club, a society or club for the purpose of debate and improvementin extemporaneous speaking.",
    "DEBATINGLY": "In the manner of a debate.",
    "DEBAUCH": "To lead away from purity or excellence; to corrupt in characteror principles; to mar; to vitiate; to pollute; to seduce; as, todebauch one's self by intemperance; to debauch a woman; to debauch anarmy.Learning not debauched by ambition. Burke.A man must have got his conscience thoroughly debauched and hardenedbefore he can arrive to the height of sin. South.Her pride debauched her judgment and her eyes. Cowley.",
    "DEBAUCHED": "Dissolute; dissipated. \"A coarse and debauched look.\" Ld.Lytton.",
    "DEBAUCHEDLY": "In a profligate manner.",
    "DEBAUCHEDNESS": "The state of being debauched; intemperance. Bp. Hall.",
    "DEBAUCHEE": "One who is given to intemperance or bacchanalian excesses; aman habitually lewd; a libertine.",
    "DEBAUCHER": "One who debauches or corrupts others; especially, a seducer tolewdness.",
    "DEBAUCHMENT": "The act of corrupting; the act of seducing from virtue or duty.",
    "DEBAUCHNESS": "Debauchedness. [Obs.]",
    "DEBEIGE": "A kind of woolen or mixed dress goods. [Written also debage.]",
    "DEBEL": "To conquer. [Obs.] Milton.",
    "DEBELLATE": "To subdue; to conquer in war. [Obs.] Speed.",
    "DEBELLATION": "The act of conquering or subduing. [Obs.]",
    "DEBENTURE STOCK": "The debt or series of debts, collectively, represented by aseries of debentures; a debt secured by a trust deed of property forthe benefit of the holders of shares in the debt or of a series ofdebentures. By the terms of much debenture stock the holders are notentitled to demand payment until the winding up of the company ordefault in payment; in the winding up of the company or default inpayment; in the case of railway debentures, they cannot demandpayment of the principal, and the debtor company cannot redeem thestock, except by authority of an act of Parliament. [Eng.]",
    "DEBENTURED": "Entitled to drawback or debenture; as, debentured goods.",
    "DEBILE": "Weak. [Obs.] Shak.",
    "DEBILITANT": "Diminishing the energy of organs; reducing excitement; as, adebilitant drug.",
    "DEBILITATE": "To impair the strength of; to weaken; to enfeeble; as, todebilitate the body by intemperance.Various ails debilitate the mind. Jenyns.The debilitated frame of Mr. Bertram was exhausted by this lasteffort. Sir W. Scott.",
    "DEBILITATION": "The act or process of debilitating, or the condition of one whois debilitated; weakness.",
    "DEBILITY": "The state of being weak; weakness; feebleness; languor.The inconveniences of too strong a perspiration, which are debility,faintness, and sometimes sudden death. Arbuthnot.",
    "DEBIT": "A debt; an entry on the debtor (Dr.) side of an account; --mostly used adjectively; as, the debit side of an account.",
    "DEBITOR": "A debtor. [Obs.] Shak.",
    "DEBITUMINIZATION": "The act of depriving of bitumen.",
    "DEBITUMINIZE": "To deprive of bitumen.",
    "DEBLAI": "The cavity from which the earth for parapets, etc. (remblai),is taken.",
    "DEBONAIR": "Characterized by courteousness, affability, or gentleness; ofgood appearance and manners; graceful; complaisant.Was never prince so meek and debonair. Spenser.",
    "DEBONAIRITY": "Debonairness. [Obs.] Chaucer.",
    "DEBONAIRLY": "Courteously; elegantly.",
    "DEBONAIRNESS": "The quality of being debonair; good humor; gentleness;courtesy. Sterne.",
    "DEBOSH": "To debauch. [Obs.] \"A deboshed lady.\" Beau. & Fl.",
    "DEBOSHMENT": "Debauchment. [Obs.]",
    "DEBOUCH": "To march out from a wood, defile, or other confined spot, intoopen ground; to issue.Battalions debouching on the plain. Prescott.",
    "DEBOUCHE": "A place for exit; an outlet; hence, a market for goods.The débouchés were ordered widened to afford easy egress. TheCentury.",
    "DEBOUCHURE": "The outward opening of a river, of a valley, or of a strait.",
    "DEBRIS": "Broken and detached fragments, taken collectively; especially,fragments detached from a rock or mountain, and piled up at the base.",
    "DEBRUISED": "Surmounted by an ordinary; as, a lion is debruised when a bendor other ordinary is placed over it, as in the cut.The lion of England and the lilies of France without the batonsinister, under which, according to the laws of heraldry, they wheredebruised in token of his illegitimate birth. Macaulay.",
    "DEBT": "An action at law to recover a certain specified sum of moneyalleged to be due. Burrill. Bond debt, Book debt, etc. See underBond, Book, etc.-- Debt of nature, death.",
    "DEBTED": "Indebted; obliged to. [R.]I stand debted to this gentleman. Shak.",
    "DEBTEE": "One to whom a debt is due; creditor; -- correlative to debtor.Blackstone.",
    "DEBTLESS": "Free from debt. Chaucer.",
    "DEBTOR": "One who owes a debt; one who is indebted; -- correlative tocreditor.[I 'll] bring your latter hazard back again, And thankfully restdebtor for the first. Shak.In Athens an insolvent debtor became slave to his creditor. Mitford.Debtors for our lives to you. Tennyson.",
    "DEBULLIATE": "To boil over. [Obs.]",
