    "DECRUSTATION": "The removal of a crust.",
    "DECRY": "To cry down; to censure as faulty, mean, or worthless; toclamor against; to blame clamorously; to discredit; to disparage.For small errors they whole plays decry. Dryden.Measures which are extolled by one half of the kingdom are naturallydecried by the other. Addison.",
    "DECUBATION": "Act of lying down; decumbence. [Obs.] Evelyn.",
    "DECUBITUS": "An attitude assumed in lying down; as, the dorsal decubitus.",
    "DECUMAN": "Large; chief; -- applied to an extraordinary billow, supposedby some to be every tenth in order. [R.] Also used substantively.\"Such decuman billows.\" Gauden. \"The baffled decuman.\" Lowell.",
    "DECUMBENT": "Reclining on the ground, as if too weak to stand, and tendingto rise at the summit or apex; as, a decumbent stem. Gray.",
    "DECUMBENTLY": "In a decumbent posture.",
