    "DESPOND": "To give up, the will, courage, or spirit; to be thoroughlydisheartened; to lose all courage; to become dispirited or depressed;to take an unhopeful view.I should despair, or at least despond. Scott's Letters.Others depress their own minds, [and] despond at the firstdifficulty. Locke.We wish that . . . desponding patriotism may turn its eyeshitherward, and be assured that foundations of our national powerstill stand strong. D. Webster.",
    "DESPONDENCE": "Despondency.The people, when once infected, lose their relish for happiness [and]saunter about with looks of despondence. Goldsmith.",
    "DESPONDENCY": "The state of desponding; loss of hope and cessation of effort;discouragement; depression or dejection of the mind.The unhappy prince seemed, during some days, to be sunk indespondency. Macaulay.",
    "DESPONDENT": "Marked by despondence; given to despondence; low-spirited; as,a despondent manner; a despondent prisoner.-- De*spond\"ent*ly, adv.",
