    "DESTINE": "To determine the future condition or application of; to setapart by design for a future use or purpose; to fix, as by destiny orby an authoritative decree; to doom; to ordain or preordain; toappoint; -- often with the remoter object preceded by to or for.We are decreed, Reserved, and destined to eternal woe. Milton.Till the loathsome opposite Of all my heart had destined, did obtain.Tennyson.Not enjoyment and not sorrow Is our destined end or way. Longfellow.",
