    "DETERMINATENESS": "State of being determinate.",
    "DETERMINATION": "A flow, rush, or tendency to a particular part; as, adetermination of blood to the head.",
    "DETERMINATIVE": "Having power to determine; limiting; shaping; directing;conclusive.Incidents . . . determinative of their course. I. Taylor.Determinative tables (Nat. Hist.), tables presenting the specificcharacter of minerals, plants, etc., to assist in determining thespecies to which a specimen belongs.",
