    "DETONATE": "To explode with a sudden report; as, niter detonates withsulphur.",
    "DETONATING": "from Detonate. Detonating gas, a mixture of two volumes ofhydrogen with one volume of oxygen, which explodes with a loud reportupon ignition.-- Detonating powder, any powder or solid substance, as fulminate ofmercury, which when struck, explodes with violence and a loud report.-- Detonating primer, a primer exploded by a fuse; -- used toexplode gun cotton in blasting operations.-- Detonating tube, a strong tube of glass, usually graduated,closed at one end, and furnished with two wires passing through itssides at opposite points, and nearly meeting, for the purpose ofexploding gaseous mixtures by an electric spark, as in gas analysis,etc.",
    "DETONATION": "An explosion or sudden report made by the instantaneousdecomposition or combustion of unstable substances' as, thedetonation of gun cotton.",
