    "DEUTEROCANONICAL": "Pertaining to a second canon, or ecclesiastical writing ofinferior authority; -- said of the Apocrypha, certain Epistles, etc.",
    "DEUTEROGAMIST": "One who marries the second time.",
    "DEUTEROGAMY": "A second marriage, after the death of the first husband ofwife; -- in distinction from bigamy, as defined in the old canon law.See Bigamy. Goldsmith.",
    "DEUTEROGENIC": "Of secondary origin; -- said of certain rocks whose materialhas been derived from older rocks.",
