    "DEXTRAD": "Toward the right side; dextrally.",
    "DEXTRAL": "Right, as opposed to sinistral, or left. Dextral shell (Zoöl.),a spiral shell the whorls of which turn from left right, or like thehands of a watch when the apex of the spire is toward the eye of theobserver.",
    "DEXTRALITY": "The state of being on the right-hand side; also, the quality ofbeing right-handed; right-handedness. Sir T. Browne.",
    "DEXTRALLY": "(adv. Towards the right; as, the hands of a watch rotatedextrally.",
    "DEXTRER": "A war horse; a destrer. [Obs.] \"By him baiteth his dextrer.\"Chaucer.",
    "DEXTRIN": "A translucent, gummy, amorphous substance, nearly tasteless andodorless, used as a substitute for gum, for sizing, etc., andobtained from starch by the action of heat, acids, or diastase. It isof somewhat variable composition, containing several carbohydrateswhich change easily to their respective varieties of sugar. It is sonamed from its rotating the plane of polarization to the right; --called also British gum, Alsace gum, gommelin, leiocome, etc. SeeAchroödextrin, and Erythrodextrin.",
    "DEXTRO-": "A prefix, from L. dexter, meaning, pertaining to, or toward,the right; (Chem. & Opt.)",
