    "DIAGNOSTICS": "That part of medicine which has to do with ascertaining thenature of diseases by means of their symptoms or signs.His rare skill in diagnostics. Macaulay.",
    "DIAGOMETER": "A sort of electroscope, invented by Rousseau, in which the drypile is employed to measure the amount of electricity transmitted bydifferent bodies, or to determine their conducting power. Nichol.",
    "DIAGONAL": "Joining two not adjacent angles of a quadrilateral ormultilateral figure; running across from corner to corner; crossingat an angle with one of the sides. Diagonal bond (Masonry),herringbone work. See Herringbone, a.-- Diagonal built (Shipbuilding), built by forming the outer skin oftwo layers of planking, making angles of about 45º with the keel, inopposite directions.-- Diagonal cleavage. See under Cleavage.-- Diagonal molding (Arch.), a chevron or zigzag molding.-- Diagonal rib. (Arch.) See Cross-springer.-- Diagonal scale, a scale which consists of a set of parallellines, with other lines crossing them obliquely, so that theirintersections furnish smaller subdivisions of the unit of measurethan could be conveniently marked on a plain scale.-- Diagonal stratification. (Geol.) Same as Cross bedding, underCross, a.",
    "DIAGONALLY": "In a diagonal direction.",
    "DIAGONIAL": "Diagonal; diametrical; hence; diametrically opposed. [Obs.]Sin can have no tenure by law at all, but is rather an eternaloutlaw, and in hostility with law past all atonement; both diagonalcontraries, as much allowing one another as day and night together inone hemisphere. Milton.",
