    "DILATION": "Delay. [Obs.] Bp. Hall.",
    "DILATIVE": "Causing dilation; tending to dilate, on enlarge; expansive.Coleridge.",
    "DILATOMETER": "An instrument for measuring the dilatation or expansion of asubstance, especially of a fluid.",
    "DILATOR": "A muscle that dilates any part.",
    "DILATORILY": "With delay; tardily.",
    "DILATORINESS": "The quality of being dilatory; lateness; slowness; tardiness;sluggishness.",
    "DILDO": "A burden in popular songs. [Obs.]Delicate burthens of dildos and fadings. Shak.",
    "DILECTION": "Love; choice. [Obs.] T. Martin.",
    "DILEMMA": "An argument which presents an antagonist with two or morealternatives, but is equally conclusive against him, whicheveralternative he chooses.",
    "DILETTANT": "Of or pertaining to dilettanteism; amateur; as, dilettantspeculation. Carlyle.",
    "DILETTANTE": "An admirer or lover of the fine arts; popularly, an amateur;especially, one who follows an art or a branch of knowledge,desultorily, or for amusement only.",
    "DILETTANTEISH": "Somewhat like a dilettante.",
    "DILETTANTEISM": "The state or quality of being a dilettante; the desultorypursuit of art, science, or literature.",
    "DILETTANTISH": "Dilettanteish.",
    "DILETTANTISM": "Same as Dilettanteism. F. Harrison.",
    "DILIGENCE": "Process by which persons, lands, or effects are seized fordebt; process for enforcing the attendance of witnesses or theproduction of writings. To do one's diligence, give diligence, usediligence, to exert one's self; to make interested and earnestendeavor.And each of them doth all his diligence To do unto the festéreverence. Chaucer.",
    "DILIGENCY": "Diligence; care; persevering endeavor. [Obs.] Milton.",
    "DILIGENTLY": "In a diligent manner; not carelessly; not negligently; withindustry or assiduity.Ye diligently keep commandments of the Lord your God. Deut. vi. 17.",
    "DILL": "An herb (Peucedanum graveolens), the seeds of which aremoderately warming, pungent, and aromatic, and were formerly used asa soothing medicine for children; -- called also dill-seed. Dr.Prior.",
    "DILLING": "A darling; a favorite. [Obs.]Whilst the birds billing, Each one with his dilling. Drayton.",
    "DILLUING": "A process of sorting ore by washing in a hand sieve. [Writtenalso deluing.]",
    "DILLY": "A kind of stagecoach. \"The Derby dilly.\" J. H. Frere.",
    "DILLY-DALLY": "To loiter or trifle; to waste time.",
    "DILOGICAL": "Ambiguous; of double meaning. [Obs.] T. Adams.",
    "DILOGY": "An ambiguous speech; a figure in which a word is used anequivocal sense. [R.]",
    "DILUCID": "Clear; lucid. [Obs.] Bacon.-- Di*lu\"cid*ly, adv. [Obs.] -- Di`lu*cid\"i*ty, n. [Obs.]",
    "DILUCIDATE": "To elucidate. [Obs.] Boyle.",
    "DILUCIDATION": "The act of making clear. [Obs.] Boyle.",
    "DILUENT": "Diluting; making thinner or weaker by admixture, esp. of water.Arbuthnot.",
    "DILUTE": "To become attenuated, thin, or weak; as, it dilutes easily.",
    "DILUTED": "Reduced in strength; thin; weak.-- Di*lut\"ed*ly, adv.",
    "DILUTENESS": "The quality or state of being dilute. Bp. Wilkins.",
    "DILUTER": "One who, or that which, dilutes or makes thin, more liquid, orweaker.",
    "DILUTION": "The act of diluting, or the state of being diluted. Arbuthnot.",
    "DILUVIAL": "Effected or produced by a flood or deluge of water; -- said ofcoarse and imperfectly stratified deposits along ancient or existingwater courses. Similar unstratified deposits were formed by theagency of ice. The time of deposition has been called the Diluvianepoch.",
    "DILUVIALIST": "One who explains geological phenomena by the Noachian deluge.Lyell.",
    "DILUVIAN": "Of or pertaining to a deluge, esp. to the Noachian deluge;diluvial; as, of diluvian origin. Buckland.",
    "DILUVIATE": "To run as a flood. [Obs.] Sir E. Sandys.",
    "DILUVIUM": "A deposit of superficial loam, sand, gravel, stones, etc.,caused by former action of flowing waters, or the melting of glacialice.",
    "DIM": "To grow dim. J. C. Shairp.",
    "DIM-SIGHTED": "Having dim sight; lacking perception.-- Dim\"-sight`ed*ness, n.",
    "DIMBLE": "A bower; a dingle. [Obs.] Drayton.",
    "DIME": "A silver coin of the United States, of the value of ten cents;the tenth of a dollar. Dime novel, a novel, commonly sensational andtrashy, which is sold for a dime, or ten cents.",
    "DIMENSION": "The degree of manifoldness of a quantity; as, time is quantityhaving one dimension; volume has three dimensions, relative toextension.",
    "DIMENSIONAL": "Pertaining to dimension.",
    "DIMENSIONED": "Having dimensions. [R.]",
    "DIMENSIONLESS": "Without dimensions; having no appreciable or noteworthy extent.Milton.",
    "DIMENSITY": "Dimension. [R.] Howell.",
    "DIMENSIVE": "Without dimensions; marking dimensions or the limits.Who can draw the soul's dimensive lines Sir J. Davies.",
    "DIMERAN": "One of the Dimera.",
    "DIMEROUS": "Composed of, or having, two parts of each kind.",
    "DIMETER": "Having two poetical measures or meters.-- n.",
    "DIMETHYL": "Ethane; -- sometimes so called because regarded as consistingof two methyl radicals. See Ethane.",
    "DIMETRIC": "Same as Tetragonal. Dana.",
    "DIMICATION": "A fight; contest. [Obs.] Bp. Hall.",
    "DIMIDIATE": "To represent the half of; to halve.",
    "DIMIDIATION": "The act of dimidiating or halving; the state of beingdimidiate.",
    "DIMINISH": "To make smaller by a half step; to make (an interval) less thanminor; as, a diminished seventh.",
    "DIMINISHABLE": "Capable of being diminished or lessened.",
    "DIMINISHER": "One who, or that which, diminishes anything. Clerke (1637).",
    "DIMINISHINGLY": "In a manner to diminish.",
    "DIMINISHMENT": "Diminution. [R.] Cheke.",
    "DIMINUENDO": "In a gradually diminishing manner; with abatement of tone;decrescendo; -- expressed on the staff by Dim., or Dimin., or thesign.",
    "DIMINUENT": "Lessening. Bp. Sanderson.",
    "DIMINUTAL": "Indicating or causing diminution. Earle.",
    "DIMINUTE": "Small; diminished; diminutive. [Obs.] Jer. Taylor.",
    "DIMINUTELY": "Diminutively. [Obs.]",
    "DIMINUTION": "Omission, inaccuracy, or defect in a record.",
    "DIMINUTIVAL": "Indicating diminution; diminutive. \"Diminutival forms\" [ofwords]. Earle.-- n.",
    "DIMINUTIVE": "A derivative from a noun, denoting a small or a young object ofthe same kind with that denoted by the primitive; as, gosling,eaglet, lambkin.Babyisms and dear diminutives. Tennyson.",
    "DIMINUTIVELY": "In a diminutive manner.",
    "DIMINUTIVENESS": "The quality of being diminutive; smallness; littleness;minuteness.",
    "DIMISH": "See Dimmish.",
    "DIMISSION": "Leave to depart; a dismissing. [Obs.] Barrow.",
    "DIMISSORY": "Sending away; dismissing to another jurisdiction; grantingleave to depart. Letters dimissory (Eccl.), letters given by a bishopdismissing a person who is removing into another diocese, andrecommending him for reception there. Hook.",
    "DIMIT": "To dismiss, let go, or release. [Obs.]",
    "DIMITY": "A cotton fabric employed for hangings and furniture coverings,and formerly used for women's under-garments. It is of many patterns,both plain and twilled, and occasionally is printed in colors.",
    "DIMLY": "In a dim or obscure manner; not brightly or clearly; withimperfect sight.",
    "DIMORPH": "Either one of the two forms of a dimorphous substance; as,calcite and aragonite are dimorphs.",
    "DIMORPHIC": "Having the property of dimorphism; dimorphous.",
    "DIMORPHISM": "Difference of form between members of the same species, as whena plant has two kinds of flowers, both hermaphrodite (as in thepartridge berry), or when there are two forms of one or both sexes ofthe same species of butterfly.Dimorphism is the condition of the appearance of the same speciesunder two dissimilar forms. Darwin.",
    "DIMORPHOUS": "Characterized by dimorphism; occurring under two distinctforms, not dependent on sex; dimorphic.",
    "DIMPLE": "To form dimples; to sink into depressions or littleinequalities.And smiling eddies dimpled on the main. Dryden.",
    "DIMPLEMENT": "The state of being dimpled, or marked with gentle depressions.[R.]The ground's most gentle dimplement. Mrs. Browning.",
    "DIMPLY": "Full of dimples, or small depressions; dimpled; as, the dimplypool. Thomson.",
    "DIMYARIAN": "Like or pertaining to the Dimya.-- n.",
    "DIMYARY": "Same as Dimyarian.",
    "DIN": "Loud, confused, harsh noise; a loud, continuous, rattling orclanging sound; clamor; roar.Think you a little din can daunt mine ears Shak.He knew the battle's din afar. Sir W. Scott.The dust and din and steam of town. Tennyson.",
    "DINAPHTHYL": "A colorless, crystalline hydrocarbon, C20H14, obtained fromnaphthylene, and consisting of a doubled naphthylene radical.",
    "DINARCHY": "See Diarchy.",
    "DINE": "To eat the principal regular meal of the day; to take dinner.Now can I break my fast, dine, sup, and sleep. Shak.To dine with Duke Humphrey, to go without dinner; -- a phrase commonin Elizabethan literature, said to be from the practice of the poorgentry, who beguiled the dinner hour by a promenade near the tomb ofHumphrey, Duke of Gloucester, in Old Saint Paul's.",
    "DINER": "One who dines.",
    "DINER-OUT": "One who often takes his dinner away from home, or in company.A brilliant diner-out, though but a curate. Byron.",
    "DINETICAL": "Revolving on an axis. [Obs.] Sir T. Browne.",
    "DING": "A thump or stroke, especially of a bell.",
    "DINGDONG": "An attachment to a clock by which the quarter hours are struckupon bells of different tones.",
    "DINGDONG THEORY": "The theory which maintains that the primitive elements oflanguage are reflex expressions induced by sensory impressions; thatis, as stated by Max Müller, the creative faculty gave to eachgeneral conception as it thrilled for the first time through thebrain a phonetic expression; -- jocosely so called from the analogyof the sound of a bell induced by the stroke of the clapper.",
    "DINGILY": "In a dingy manner.",
    "DINGINESS": "Quality of being dingy; a dusky hue.",
    "DINGLE": "A narrow dale; a small dell; a small, secluded, and emboweredvalley.",
    "DINGLE-DANGLE": "In a dangling manner.",
    "DINGO": "A wild dog found in Australia, but supposed to have introducedat a very early period. It has a wolflike face, bushy tail, and areddish brown color.",
    "DINGTHRIFT": "A spendthrift. [Obs.]Wilt thou, therefore, a drunkard be, A dingthrift and a knave Drant.",
    "DINGY": "Soiled; sullied; of a dark or dusky color; dark brown; dirty.\"Scraps of dingy paper.\" Macaulay.",
    "DINICHTHYS": "A genus of large extinct Devonian ganoid fishes. In some partsof Ohio remains of the Dinichthys are abundant, indicating animalstwenty feet in length.",
    "DINING": "from Dine, a.",
    "DINK": "Trim; neat. [Scot.] Burns.-- Dink\"ly, adv.",
    "DINMONT": "A wether sheep between one and two years old. [Scot.]",
    "DINNERLESS": "Having no dinner. Fuller.",
    "DINNERLY": "Of or pertaining to dinner. [R.]The dinnerly officer. Copley.",
    "DINOCERAS": "A genus of large extinct Eocene mammals from Wyoming; -- calledalso Uintatherium. See Illustration in Appendix.",
    "DINORNIS": "A genus of extinct, ostrichlike birds of gigantic size, whichformerly inhabited New Zealand. See Moa. [Written also Deinornis.]",
    "DINOSAURIA": "An order of extinct mesozoic reptiles, mostly of large size(whence the name). Notwithstanding their size, they present birdlikecharacters in the skeleton, esp. in the pelvis and hind limbs. Somewalked on their three-toed hind feet, thus producing the large \"birdtracks,\" so-called, of mesozoic sandstones; others were five-toed andquadrupedal. See Illust. of Compsognathus, also Illustration ofDinosaur in Appendix.",
    "DINOXIDE": "Same as Dioxide.",
    "DINSOME": "Full of din. [Scot.] Burns.",
    "DINT": "To make a mark or cavity on or in, by a blow or by pressure; todent. Donne. Tennyson.",
    "DINUMERATION": "Enumeration. [Obs.] Bullokar.",
    "DIOCESAN": "Of or pertaining to a diocese; as, diocesan missions.",
    "DIOCESE": "The circuit or extent of a bishop's jurisdiction; the districtin which a bishop exercises his ecclesiastical authority.[Frequently, but improperly, spelt diocess.]",
    "DIOCESENER": "One who belongs to a diocese. [Obs.] Bacon.",
    "DIODON": "A genus of spinose, plectognath fishes, having the teeth ofeach jaw united into a single beaklike plate. They are able toinflate the body by taking in air or water, and, hence, are calledglobefishes, swellfishes, etc. fishes, and sea hedgehogs.",
    "DIODONT": "Like or pertaining to the genus Diodon.-- n.",
    "DIOECIA": "A Linnæan class of plants having the stamens and pistils ondifferent plants.",
    "DIOECIOUSLY": "In a dioecious manner. Dioeciously hermaphrodite (Bot.), havingflowers structurally perfect, but practically dioecious, -- those onone plant producing no pollen, and those on another no ovules.",
    "DIOECIOUSNESS": "The state or quality of being dioecious.",
    "DIOECISM": "The condition of being dioecious.",
    "DIOGENES": "A Greek Cynic philosopher (412-323 B. C.) who lived much inAthens and was distinguished for contempt of the common aims andconditions of life, and for sharp, caustic sayings. Diogenes' crab(Zoöl.), a species of terrestrial hermit crabs (Cenobita Diogenes),abundant in the West Indies and often destructive to crops.-- Diogenes' tub, the tub which the philosopher Diogenes is said tohave carried about with him as his house, in which he lived.",
    "DIOICOUS": "See Dioecious.",
    "DIOMEDEA": "A genus of large sea birds, including the albatross. SeeAlbatross.",
    "DIONAEA": "An insectivorous plant. See Venus's flytrap.",
    "DIONYSIA": "Any of the festivals held in honor of the Olympian godDionysus. They correspond to the Roman Bacchanalia; the greaterDionysia were held at Athens in March or April, and were celebratedwith elaborate performances of both tragedies and comedies.",
    "DIONYSIAC": "Of or pertaining to Dionysus or to the Dionysia; Bacchic; as, aDionysiac festival; the Dionysiac theater at Athens.",
    "DIONYSIAN": "Relating to Dionysius, a monk of the 6th century; as, theDionysian, or Christian, era. Dionysian period, a period of 532years, depending on the cycle of the sun, or 28 years, and the cycleof the moon, or 19 years; -- sometimes called the Greek paschalcycle, or Victorian period.",
    "DIOPHANTINE": "Originated or taught by Diophantus, the Greek writer onalgebra. Diophantine analysis (Alg.), that branch of indeterminateanalysis which has for its object the discovery of rational valuesthat satisfy given equations containing squares or cubes; as, forexample, to find values of x and y which make x2 + y2 an exactsquare.",
    "DIOPSIDE": "A crystallized variety of pyroxene, of a clear, grayish greencolor; mussite.",
    "DIOPTASE": "A hydrous silicate of copper, occurring in emerald-greencrystals.",
    "DIOPTRE": "A unit employed by oculists in numbering glasses according tothe metric system; a refractive power equal to that of a glass whoseprincipal focal distance is one meter.",
    "DIOPTRIC": "Of or pertaining to the dioptre, or to the metric system ofnumbering glasses.-- n.",
    "DIOPTRICS": "The science of the refraction of light; that part ofgeometrical optics which treats of the laws of the refraction oflight in passing from one medium into another, or through differentmediums, as air, water, or glass, and esp. through different lenses;-- distinguished from catoptrics, which refers to reflected light.",
    "DIOPTRY": "A dioptre.",
    "DIORAMIC": "Pertaining to a diorama.",
    "DIORISM": "Definition; logical direction. [Obs.] Dr. H. More.",
    "DIORISTIC": "Distinguishing; distinctive; defining. [R.] --Di`o*ris\"tic*al*ly, adv. [R.] Dr. H. More.",
    "DIORITE": "An igneous, crystalline in structure, consisting essentially ofa triclinic feldspar and hornblende. It includes part of what wascalled greenstone.",
    "DIORITIC": "Containing diorite.",
    "DIORTHOTIC": "Relating to the correcting or straightening out of something;corrective.",
    "DIOSCOREA": "A genus of plants. See Yam.",
    "DIOTA": "A vase or drinking cup having two handles or ears.",
    "DIOXINDOL": "A white, crystalline, nitrogenous substance obtained by thereduction of isatin. It is a member of the indol series; -- hence itsname.",
    "DIPASCHAL": "Including two passovers. Carpenter.",
    "DIPCHICK": "See Dabchick.",
    "DIPETALOUS": "Having two petals; two-petaled.",
    "DIPHENYL": "A white crystalline substance, C6H5.C6H5, obtained by leadingbenzene through a heated iron tube. It consists of two benzene orphenyl radicals united.",
    "DIPHTHERIA": "A very dangerous contagious disease in which the air passages,and especially the throat, become coated with a false membrane,produced by the solidification of an inflammatory exudation. Cf.Group.",
    "DIPHTHONG": "To form or pronounce as a diphthong; diphthongize. [R.]",
    "DIPHTHONGAL": "Relating or belonging to a diphthong; having the nature of adiphthong.-- Diph*thon\"gal*ly, adv.",
    "DIPHTHONGALIZE": "To make into a diphthong; to pronounce as a diphthong.",
    "DIPHTHONGATION": "See Diphthongization.",
    "DIPHTHONGIC": "Of the nature of diphthong; diphthongal. H. Sweet.",
    "DIPHTHONGIZATION": "The act of changing into a diphthong. H. Sweet.",
    "DIPHTHONGIZE": "To change into a diphthong, as by affixing another vowel to asimple vowel. \"The diphthongized long vowels.\" H. Sweet.",
    "DIPHYCERCAL": "Having the tail fin divided into two equal parts by thenotochord, or end of the vertebral column; protocercal. SeeProtocercal.",
    "DIPHYGENIC": "Having two modes of embryonic development.",
    "DIPHYLLOUS": "Having two leaves, as a calyx, etc.",
    "DIPHYODONT": "Having two successive sets of teeth (deciduous and permanent),one succeeding the other; as, a diphyodont mammal; diphyodontdentition; -- opposed to monophyodont.-- n.",
    "DIPHYOZOOID": "One of the free-swimming sexual zooids of Siphonophora.",
    "DIPLANAR": "Of or pertaining to two planes.",
    "DIPLEIDOSCOPE": "An instrument for determining the time of apparent noon. Itconsists of two mirrors and a plane glass disposed in the form of aprism, so that, by the reflections of the sun's rays from theirsurfaces, two images are presented to the eye, moving in oppositedirections, and coinciding at the instant the sun's center is on themeridian.",
    "DIPLEX": "Pertaining to the sending of two messages in the same directionat the same time. Diplex and contraplex are the two varieties ofduplex.",
    "DIPLOBLASTIC": "Characterizing the ovum when it has two primary germinallayers.",
    "DIPLOCARDIAC": "Having the heart completely divided or double, one sidesystemic, the other pulmonary.",
    "DIPLOCOCCUS": "A form of micrococcus in which cocci are united in a binarymanner. See Micrococcus.",
    "DIPLOE": "The soft, spongy, or cancellated substance between the platesof the skull.",
    "DIPLOETIC": "Diploic.",
    "DIPLOGENIC": "Partaking of the nature of two bodies; producing twosubstances. Wright.",
    "DIPLOGRAPH": "An instrument used for double writing, as one for producingembossed writing for the blind and ordinary writing at the same time.-- Dip`lo*graph\"ic*al (#), a. -- Dip*log\"ra*phy (#), n.",
    "DIPLOIC": "Of or pertaining to the diploë.",
    "DIPLOID": "A solid bounded by twenty-four similar quadrilateral faces. Itis a hemihedral form of the hexoctahedron.",
    "DIPLOMA": "A letter or writing, usually under seal, conferring someprivilege, honor, or power; a document bearing record of a degreeconferred by a literary society or educational institution.",
    "DIPLOMACY": "A diplomatist.",
    "DIPLOMATE": "To invest with a title o [R.] Wood.",
    "DIPLOMATIAL": "Diplomatic. [R.]",
    "DIPLOMATIC": "A minister, official agent, or envoy to a foreign court; adiplomatist.",
    "DIPLOMATICALLY": "According to the rules of diplomacy; in the manner of adiplomatist; artfully.",
    "DIPLOMATICS": "The science of diplomas, or the art of deciphering ancientwritings, and determining their age, authenticity, etc.; paleography.",
    "DIPLOMATISM": "Diplomacy. [R.]",
    "DIPLOMATIST": "A person employed in, or skilled in, diplomacy; a diplomat.In ability, Avaux had no superior among the numerous able diplomaticswhom his country then possessed. Macaulay.",
    "DIPLOPOD": "One of the Diplopoda.",
    "DIPLOPODA": "An order of myriapods having two pairs of legs on each segment;the Chilognatha.",
    "DIPLOSTEMONOUS": "Having twice as many stamens as petals, as the geranium. R.Brown.",
    "DIPLOSTEMONY": "The condition of being diplostemonous.",
    "DIPNEUMONA": "A group of spiders having only two lunglike organs. [Writtenalso Dipneumones.]",
    "DIPNOI": "A group of ganoid fishes, including the living genera Ceratodusand Lepidosiren, which present the closest approximation to theAmphibia. The air bladder acts as a lung, and the nostrils openinside the mouth. See Ceratodus, and Illustration in Appendix.",
    "DIPODY": "Two metrical feet taken together, or included in one measure.Hadley.Trochaic, iambic, and anapestic verses . . . are measured bydipodies. W. W. Goodwin.",
    "DIPOLAR": "Having two poles, as a magnetic bar.",
    "DIPRISMATIC": "Doubly prismatic.",
    "DIPROPARGYL": "A pungent, mobile, volatile liquid, C6H6, produced artificiallyfrom certain allyl derivatives. Though isomeric with benzine, it isvery different in its chemical relations. Called also dipropinyl.",
    "DIPROPYL": "One of the hexane paraffins, found in petroleum, consisting oftwo propyl radicals. See Hexane.",
    "DIPROTODON": "An extinct Quaternary marsupial from Australia, about as largeas the hippopotamus; -- so named because of its two large frontteeth. See Illustration in Appendix.",
    "DIPSAS": "A genus of harmless colubrine snakes.",
    "DIPSETIC": "Tending to produce thirst. Wright.",
    "DIPSOMANIA": "A morbid an uncontrollable craving (often periodic) for drink,esp. for alcoholic liquors; also improperly used to denote acute andchronic alcoholism.",
    "DIPSOMANIAC": "One who has an irrepressible desire for alcoholic drinks.",
    "DIPSOMANIACAL": "Of or pertaining to dipsomania.",
    "DIPSOSIS": "Excessive thirst produced by disease.",
    "DIPTERA": "An extensive order of insects having only two functional wingsand two balancers, as the house fly, mosquito, etc. They have asuctorial proboscis, often including two pairs of sharp organs(mandibles and maxillæ) with which they pierce the skin of animals.They undergo a complete metamorphosis, their larvæ (called maggots)being usually without feet.",
    "DIPTERAL": "Having two wings only; belonging to the order Diptera.",
    "DIPTERAN": "An insect of the order Diptera.",
    "DIPTEROCARPUS": "A genus of trees found in the East Indies, some species ofwhich produce a fragrant resin, other species wood oil. The fruit hastwo long wings.",
    "DIPTEROUS": "Having two wings, as certain insects; belonging to the orderDiptera.",
    "DIPTERYGIAN": "Having two dorsal fins; -- said of certain fishes.",
    "DIPTOTE": "A noun which has only two cases. Andrews.",
    "DIPYRE": "A mineral of the scapolite group; -- so called from the doubleeffect of fire upon it, in fusing it, and rendering itphosphorescent.",
    "DIPYRENOUS": "Containing two stones or nutlets.",
    "DIPYRIDINE": "A polymeric form of pyridine, C10H10N2, obtained as a colorlessoil by the action of sodium on pyridine.",
    "DIPYRIDYL": "A crystalline nitrogenous base, C10H8N2, obtained by thereduction of pyridine.",
    "DIRADIATION": "The emission and diffusion of rays of light.",
    "DIRECT": "In the direction of the general planetary motion, or from westto east; in the order of the signs; not retrograde; -- said of themotion of a celestial body. Direct action. (Mach.) See Direct-acting.-- Direct discourse (Gram.), the language of any one quoted withoutchange in its form; as, he said \"I can not come;\" -- correlative toindirect discourse, in which there is change of form; as, he saidthat he could not come. They are often called respectively by theirLatin names, oratio directa, and oratio obliqua.-- Direct evidence (Law), evidence which is positive or notinferential; -- opposed to circumstantial, or indirect, evidence.-- This distinction, however, is merely formal, since there is nodirect evidence that is not circumstantial, or dependent oncircumstances for its credibility. Wharton.-- Direct examination (Law), the first examination of a witness inthe orderly course, upon the merits. Abbott.-- Direct fire (Mil.), fire, the direction of which is perpendicularto the line of troops or to the parapet aimed at.-- Direct process (Metal.), one which yields metal in workingcondition by a single process from the ore. Knight.-- Direct tax, a tax assessed directly on lands, etc., and polls,distinguished from taxes on merchandise, or customs, and from excise.",
    "DIRECT ACTION": "See Syndicalism, below.",
    "DIRECT NOMINATION": "The nomination or designation of candidates for public officeby direct popular vote rather than through the action of a conventionor body of elected nominating representatives or delegates. The termis applied both to the nomination of candidates without anynominating convention, and, loosely, to the nomination effected, asin the case of candidates for president or senator of the UnitedStates, by the election of nominating representatives pledged orinstructed to vote for certain candidates dssignated by popular vote.",
    "DIRECT PRIMARY": "A primary by which direct nominations of candidates for officeare made.",
    "DIRECT-ACTING": "Acting directly, as one part upon another, without theintervention of other working parts. Direct-acting steam engine, onein which motion is transmitted to the crank without the interventionof a beam or lever; -- also called direct-action steam engine.-- Direct-acting steam pump, one in which the steam piston rod isdirectly connected with the pump rod; -- also called direct-actionsteam pump.",
    "DIRECT-COUPLED": "Coupled without intermediate connections, as an engine and adynamo.",
    "DIRECTER": "One who directs; a director. Directer plane (Geom.), the planeto which all right-lined elements in a warped surface are parallel.",
    "DIRECTION": "The pointing of a piece with reference to an imaginary verticalaxis; -- distinguished from elevation. The direction is given whenthe plane of sight passes through the object. Wilhelm.",
    "DIRECTNESS": "The quality of being direct; straightness; straightforwardness;immediateness.",
    "DIRECTOIRE STYLE": "A style of dress prevalent at the time of the French Directory,characterized by great extravagance of design and imitating the Greekand Roman costumes.",
    "DIRECTOR": "A part of a machine or instrument which directs its motion oraction.",
    "DIRECTORATE": "The office of director; also, a body of directors takenjointly.",
    "DIRECTORSHIP": "The condition or office of a director; directorate.",
    "DIRECTORY": "Containing directions; enjoining; instructing; directorial.",
    "DIRECTRESS": "A woman who directs. Bp. Hurd.",
