    "DISINCARCERATE": "To liberate from prison. [R.] Harvey.",
    "DISINCLINATION": "The state of being disinclined; want of propensity, desire, oraffection; slight aversion or dislike; indisposition.Disappointment gave him a disinclination to the fair sex. Arbuthnot.Having a disinclination to books or business. Guardian.",
    "DISINCLINE": "To incline away the affections of; to excite a slight aversionin; to indispose; to make unwilling; to alienate.Careful . . . to disincline them from any reverence or affection tothe Queen. Clarendon.To social scenes by nature disinclined. Cowper.",
    "DISINCLOSE": "To free from being inclosed.",
    "DISINCORPORATE": "Separated from, or not included in, a corporation;disincorporated. Bacon.",
    "DISINCORPORATION": "Deprivation of the rights and privileges of a corporation. T.Warton.",
    "DISINFECT": "To free from infectious or contagious matter; to destroyputrefaction; to purify; to make innocuous.When the infectious matter and the infectious matter and theodoriferous matter are one . . . then to deodorize is to disinfect.Ure.",
    "DISINFECTANT": "That which disinfects; an agent for removing the causes ofinfection, as chlorine.",
    "DISINFECTION": "The act of disinfecting; purification from infecting matter.",
    "DISINFECTOR": "One who, or that which, disinfects; an apparatus for applyingdisinfectants.",
    "DISINFLAME": "To divest of flame or ardor. Chapman.",
    "DISINGENUITY": "Disingenuousness. [Obs.] Clarendon.",
    "DISINHABITED": "Uninhabited. [Obs.]",
    "DISINHERISON": "Same as Disherison. Bacon.",
    "DISINHERITANCE": "The act of disinheriting, or the condition of being;disinherited; disherison.",
    "DISINHUME": "To disinter. [R.]",
    "DISINSURE": "To render insecure; to put in danger. [Obs.] Fanshawe.",
    "DISINTEGRABLE": "Capable of being disintegrated, or reduced to fragments orpowder.Argillo-calcite is readily disintegrable by exposure. Kirwan.",
    "DISINTEGRATE": "To separate into integrant parts; to reduce to fragments or topowder; to break up, or cause to fall to pieces, as a rock, by blowsof a hammer, frost, rain, and other mechanical or atmosphericinfluences.Marlites are not disintegrated by exposure to the atmosphere, atleast in six years. Kirwan.",
    "DISINTEGRATOR": "A machine for grinding or pulverizing by percussion.",
    "DISINTERESS": "To deprive or rid of interest in, or regard for; to disengage.[Obs.]",
    "DISINTERESSMENT": "Disinterestedness; impartiality; fairness. [Obs.] Prior.",
    "DISINTEREST": "Disinterested. [Obs.]The measures they shall walk by shall be disinterest and even. Jer.Taylor.",
    "DISINTERESTED": "Not influenced by regard to personal interest or advantage;free from selfish motive; having no relation of interest or feeling;not biased or prejudiced; as, a disinterested decision or judge.The happiness of disinterested sacrifices. Channing.",
    "DISINTERESTEDLY": "In a disinterested manner; without bias or prejudice.",
    "DISINTERESTEDNESS": "The state or quality of being disinterested; impartiality.That perfect disinterestedness and self-devotion of which man seemsto be incapable, but which is sometimes found in woman. Macaulay.",
    "DISINTERESTING": "Uninteresting. [Obs.] \"Disinteresting passages.\" Bp. Warburton.",
    "DISINTERMENT": "The act of disinterring, or taking out of the earth;exhumation.",
    "DISINTHRALL": "To free from thralldom; to disenthrall. [Written alsodisinthral.]",
    "DISINTHRALLMENT": "A releasing from thralldom or slavery; disenthrallment.[Written also disinthralment.]",
    "DISINTRICATE": "To disentangle. [R.] \"To disintricate the question.\" Sir W.Hamilton.",
    "DISINURE": "To render unaccustomed or unfamiliar.We are hindered and disinured . . . towards the true knowledge.Milton.",
    "DISINVESTITURE": "The act of depriving of investiture. [Obs.] Ogilvie.",
    "DISINVIGORATE": "To enervate; to weaken. [R.] Sydney Smith.",
    "DISINVOLVE": "To uncover; to unfold or unroll; to disentangle. [R.] Dr. H.More.",
    "DISJECTION": "Destruction; dispersion. Bp. Horsley.",
    "DISJOIN": "To part; to disunite; to separate; to sunder.That marriage, therefore, God himself disjoins. Milton.Never let us lay down our arms against France, till we have utterlydisjoined her from the Spanish monarchy. Addison.Windmill Street consisted of disjoined houses. Pennant.",
    "DISJOINT": "Disjointed; unconnected; -- opposed to conjoint. Milton.",
    "DISJOINTED": "Separated at the joints; disconnected; incoherent.-- Dis*joint\"ed*ly, adv.-- Dis*joint\"ed*ness, n.",
    "DISJOINTLY": "In a disjointed state. Sandys.",
    "DISJUDICATION": "Judgment; discrimination. See Dijudication. [Obs.] Boyle.",
    "DISJUNCT": "Having the head, thorax, and abdomen separated by a deepconstriction. Disjunct tetrachords (Mus.), tetrachords so disposed toeach other that the gravest note of the upper is one note higher thanthe acutest note of the other.",
    "DISJUNCTIVE": "Pertaining to disjunct tetrachords. \"Disjunctive notes.\" Moore(Encyc. of Music). Disjunctive conjunction (Gram.), one connectinggrammatically two words or clauses, expressing at the same time anopposition or separation inherent in the notions or thoughts; as,either, or, neither, nor, but, although, except, lest, etc.-- Disjunctive proposition, one in which the parts are connected bydisjunctive conjunctions; as it is either day or night.-- Disjunctive syllogism (Logic), one in which the major propositionis disjunctive; as, the earth moves in a circle or an ellipse; but indoes not move in a circle, therefore it moves in an ellipse.",
    "DISJUNCTIVELY": "In a disjunctive manner; separately. Dr. H. More.",
    "DISJUNCTURE": "The act of disjoining, or state of being disjoined; separation.Fuller.",
    "DISK": "The circular figure of a celestial body, as seen projected ofthe heavens.",
    "DISK CLUTCH": "A friction clutch in which the gripping surfaces are disks ormore or less resemble disks.",
    "DISKINDNESS": "Unkindness; disservice. [R.] A. Tucker.",
    "DISKLESS": "Having no disk; appearing as a point and not expanded into adisk, as the image of a faint star in a telescope.",
    "DISLADE": "To unlade. [Obs.] Heywood.",
    "DISLEAL": "Disloyal; perfidious. [Obs.] \"Disleal knight.\" Spenser.",
    "DISLEAVE": "To deprive of leaves. [R.]The cankerworms that annually that disleaved the elms. Lowell.",
    "DISLIKEFUL": "Full of dislike; disaffected; malign; disagreeable. [Obs.]Spenser.",
    "DISLIKELIHOOD": "The want of likelihood; improbability. Sir W. Scott.",
    "DISLIKEN": "To make unlike; to disguise. [Obs.] Shak.",
    "DISLIKENESS": "Unlikeness. [R.] Locke.",
    "DISLIKER": "One who dislikes or disrelishes.",
    "DISLIMB": "To tear limb from limb; to dismember. [Obs.] Bailey.",
    "DISLIMN": "To efface, as a picture. [Obs.] Shak.",
    "DISLINK": "To unlink; to disunite; to separate. [R.] Tennyson.",
    "DISLIVE": "To deprive of life. [Obs.]Telemachus dislived Amphimedon. Chapman.",
    "DISLOCATE": "To displace; to put out of its proper place. Especially, of abone: To remove from its normal connections with a neighboring bone;to put out of joint; to move from its socket; to disjoint; as, todislocate your bones. Shak.After some time the strata on all sides of the globe were dislocated.Woodward.And thus the archbishop's see, dislocated or out of joint for a time,was by the hands of his holiness set right again. Fuller.",
    "DISLOCATION": "The displacement of parts of rocks or portions of strata fromthe situation which they originally occupied. Slips, faults, and thelike, are dislocations.",
    "DISLODGE": "To go from a place of rest. [R.]Where Light and Darkness in perpetual round Lodge and dislodge byturns. Milton.",
    "DISLODGMENT": "The act or process of dislodging, or the state of beingdislodged.",
    "DISLOIGN": "To put at a distance; to remove. [Obs.]Low-looking dales, disloigned from common gaze. Spenser.",
    "DISLOYAL": "Not loyal; not true to a sovereign or lawful superior, or tothe government under which one lives; false where allegiance is due;faithless; as, a subject disloyal to the king; a husband disloyal tohis wife.Without a thought disloyal. Mrs. Browning.",
    "DISLOYALLY": "In a disloyal manner.",
    "DISLOYALTY": "Want of loyalty; lack of fidelity; violation of allegiance.",
    "DISMAIL": "To divest of coat of mail. Spenser.",
    "DISMALLY": "In a dismal manner; gloomily; sorrowfully; uncomfortably.",
    "DISMALNESS": "The quality of being dismal; gloominess.",
    "DISMAN": "To unman. [Obs.] Feltham.",
    "DISMARCH": "To march away. [Obs.]",
    "DISMARRY": "To free from the bonds of marriage; to divorce. [Obs.] Ld.Berners.",
    "DISMARSHAL": "To disarrange; to derange; to put in disorder. [R.] Drummond.",
    "DISMASK": "To divest of a mask. Shak.",
    "DISMAST": "To deprive of a mast of masts; to break and carry away themasts from; as, a storm dismasted the ship.",
    "DISMASTMENT": "The act of dismasting; the state of being dismasted. [R.]Marshall.",
    "DISMAW": "To eject from the maw; to disgorge. [R.] Shelton.",
    "DISMAY": "To take dismay or fright; to be filled with dismay. [Obs.]Shak.",
    "DISMAYEDNESS": "A state of being dismayed; dejection of courage;dispiritedness.",
    "DISMAYFUL": "Terrifying. Spenser.",
    "DISME": "A tenth; a tenth part; a tithe. Ayliffe.",
    "DISMEMBERMENT": "The act of dismembering, or the state of being dismembered;cutting in piece; mThe Castilians would doubtless have resented the dismemberment of theunwieldy body of which they formed the head. Macaulay.",
    "DISMETTLED": "Destitute of mettle, that is, or fire or spirit. [R.]Llewellyn.",
    "DISMISS": "Dismission. [Obs.] Sir T. Herbert.",
    "DISMISSAL": "Dismission; discharge.Officeholders were commanded faithfully to enforce it, upon pain ofimmediate dismissal. Motley.",
    "DISMISSIVE": "Giving dismission.",
    "DISMORTGAGE": "To redeem from mortgage. [Obs.] Howell.",
    "DISMOUNT": "To take down, or apart, as a machine.",
    "DISNATURALIZE": "To make alien; to deprive of the privileges of birth. Locke.",
    "DISNATURED": "Deprived or destitute of natural feelings; unnatural. [Obs.]Shak.",
    "DISOBEDIENCE": "Neglect or refusal to obey; violation of a command orprohibition.He is undutiful to him other actions, and lives in open disobedience.Tillotson.",
    "DISOBEDIENCY": "Disobedience.",
    "DISOBEDIENTLY": "In a disobedient manner.",
    "DISOBEISANCE": "Disobedience. [Obs.] E. Hall.",
    "DISOBEISANT": "Disobedient. [Obs.] Chaucer.",
    "DISOBEY": "Not to obey; to neglect or refuse to obey (a superior or hiscommands, the laws, etc.); to transgress the commands of (one inauthority); to violate, as an order; as, refractory children disobeytheir parents; men disobey their Maker and the laws.Not to disobey her lord's behest. Tennyson.",
    "DISOBEYER": "One who disobeys.",
    "DISOBLIGATORY": "Releasing from obligation. \"Disobligatory power.\" Charles I.",
    "DISOBLIGEMENT": "Release from obligation. [Obs.]",
    "DISOBLIGER": "One who disobliges.",
    "DISOCCIDENT": "To turn away from the west; to throw out of reckoning as tolongitude. [Obs.] Marvell.",
    "DISOCCUPATION": "The state of being unemployed; want of occupation. [R.]",
    "DISOPINION": "Want or difference of belief; disbelief. [Obs.] Bp. Reynolds.",
    "DISOPPILATE": "To open. [Obs.] Holland.",
    "DISORB": "To throw out of the proper orbit; to unsphere. Shak.",
    "DISORD": "Disorder. [Obs.] Holland.",
    "DISORDEINED": "Inordinate; irregular; vicious. [Obs.] Chaucer.",
    "DISORDERLINESS": "The state of being disorderly.",
    "DISORDERLY": "Offensive to good morals and public decency; notoriouslyoffensive; as, a disorderly house.",
    "DISORDINANCE": "Disarrangement; disturbance. [Obs.] Chaucer.",
    "DISORDINATE": "Inordinate; disorderly. [Obs.] \"With disordinate gestures.\"Prynne.",
    "DISORDINATELY": "Inordinately. [Obs.] E. Hall.",
    "DISORDINATION": "The state of being in disorder; derangement; confusion. [Obs.]Bacon.",
    "DISORGANIZE": "To destroy the organic structure or regular system of (agovernment, a society, a party, etc.); to break up (what isorganized); to throw into utter disorder; to disarrange.Lyford . . . attempted to disorganize the church. Eliot (1809).",
    "DISORGANIZER": "One who disorganizes or causes disorder and confusion.",
    "DISORIENT": "To turn away from the cast; to confuse as to which way is east;to cause to lose one's bearings. [R.] Bp. Warburton.",
    "DISORIENTATE": "To turn away from the east, or (figuratively) from the right orthe truth. [R.]",
    "DISOWNMENT": "Act of disowning. [R.]",
    "DISOXIDATE": "To deoxidate; to deoxidize. [R.]",
    "DISOXIDATION": "Deoxidation. [R.]",
    "DISOXYGENATE": "To deprive of oxygen; to deoxidize. [R.]",
    "DISOXYGENATION": "Deoxidation. [R.]",
    "DISPACE": "To roam. [Obs.]In this fair plot dispacing to and fro. Spenser.",
    "DISPAIR": "To separate (a pair). [R.]I have . . . dispaired two doves. Beau. & Fl.",
    "DISPAND": "To spread out; to expand. [Obs.] Bailey.",
    "DISPANSION": "Act of dispanding, or state of being dispanded. [Obs.]",
    "DISPARADISED": "Removed from paradise. [R.] Cockeram.",
    "DISPARAGE": "Inequality in marriage; marriage with an inferior. [Obs.]Chaucer.Dissuaded her from such a disparage. Spenser.",
    "DISPARAGER": "One who disparages or dishonors; one who vilifies or disgraces.",
    "DISPARAGINGLY": "In a manner to disparage or dishonor; slightingly.",
    "DISPARATE": "Pertaining to two coördinate species or divisions.",
    "DISPARATES": "Things so unequal or unlike that they can not be compared witheach other.",
    "DISPARITION": "Act of disappearing; disappearance. [Obs.] Bp. Hall.",
    "DISPARITY": "Inequality; difference in age, rank, condition, or excellence;dissimilitude; -- followed by between, in, of, as to, etc.; as,disparity in, or of, years; a disparity as to color.The disparity between God and his intelligent creatures. I. Taylor.The disparity of numbers was not such as ought to cause anyuneasiness. Macaulay.",
    "DISPARKLE": "To scatter abroad. [Obs.] Holland.",
    "DISPART": "To part asunder; to divide; to separate; to sever; to rend; torive or split; as, disparted air; disparted towers. [Archaic]Them in twelve troops their captain did dispart. Spenser.The world will be whole, and refuses to be disparted. Emerson.",
    "DISPASSION": "Freedom from passion; an undisturbed state; apathy. Sir W.Temple.",
    "DISPASSIONED": "Free from passion; dispassionate. [R.] \"Dispassioned men.\"Donne.",
    "DISPATCH": "To make haste; to conclude an affair; to finish a matter ofbusiness.They have dispatched with Pompey. Shak.",
    "DISPATCHER": "One who dispatches.",
    "DISPATCHFUL": "Bent on haste; intent on speedy execution of business or anytask; indicating haste; quick; as, dispatchful looks. Milton.",
    "DISPATCHMENT": "The act of dispatching. [Obs.] State Trials (1529).",
    "DISPATHY": "Lack of sympathy; want of passion; apathy. [R.]Many discrepancies and some dispathies between us. Southey.",
    "DISPAUPER": "To deprive of the claim of a pauper to public support; todeprive of the privilege of suing in forma pauperis.",
    "DISPAUPERIZE": "To free a state of pauperism, or from paupers. J. S. Mill.",
    "DISPEED": "To send off with speed; to dispatch. [Obs.] Knolles.Then they dispeeded themselves of the Cid and of their mother-in-law,DoSouthey.",
    "DISPEL": "To drive away by scattering, or so to cause to vanish; to clearaway; to banish; to dissipate; as, to dispel a cloud, vapors, cares,doubts, illusions.[Satan] gently raised their fainting courage, and dispelled theirfears. Milton.I saw myself the lambent easy light Gild the brown horror, and dispelthe night. Dryden.",
    "DISPENCE": "See Dispense. [Obs.]",
    "DISPEND": "To spend; to lay out; to expend. [Obs.] Spenser.Able to dispend yearly twenty pounds and above. Fuller.",
    "DISPENDER": "One who dispends or expends; a steward. [Obs.] Wyclif (1 Cor.iv. 1).",
    "DISPENSABLENESS": "Quality of being dispensable.",
    "DISPENSATION": "a system of principles, promises, and rules ordained andadministered; scheme; economy; as, the Patriarchal, Mosaic, andChristian dispensations.Neither are God's methods or intentions different in hisdispensations to each private man. Rogers.",
    "DISPENSATIVE": "Granting dispensation.",
    "DISPENSATIVELY": "By dispensation. Wotton.",
    "DISPENSATOR": "A distributer; a dispenser. Bacon.",
    "DISPENSATORILY": "In the way of dispensation; dispensatively.",
    "DISPENSATORY": "Granting, or authorized to grant, dispensations. \"Dispensatorypower.\" Bp. Rainbow.",
    "DISPENSE": "Dispensation; exemption. [Obs.]",
    "DISPENSER": "One who, or that which, dispenses; a distributer; as, adispenser of favors.",
    "DISPEOPLE": "To deprive of inhabitants; to depopulate.Leave the land dispeopled and desolate. Sir T. More.A certain island long before dispeopled . . . by sea rivers. Milton.",
    "DISPEOPLER": "One who, or that which, dispeoples; a depopulator. Gay.",
    "DISPERGE": "To sprinkle. [Obs.]",
    "DISPERMOUS": "Containing only two seeds; two-seeded.",
    "DISPERPLE": "To scatter; to sprinkle. [Obs.]Odorous water was Disperpled lightly on my head and neck. Chapman.",
    "DISPERSAL": "The act or result of dispersing or scattering; dispersion.Darwin.",
    "DISPERSED": "Scattered.-- Dis*pers\"ed*ly, adv.-- Dis*pers\"ed*ness, n. Dispersed harmony (Mus.), harmony in whichthe tones composing the chord are widely separated, as by an octaveor more.",
    "DISPERSENESS": "Dispersedness. [Obs.]",
    "DISPERSER": "One that disperses.",
    "DISPERSION": "The separation of light into its different colored rays,arising from their different refrangibilities. Dispersion of theoptic axes (Crystallog.), the separation of the optic axes in biaxialcrystals, due to the fact that the axial angle has different valuesfor the different colors of the spectrum.",
    "DISPERSIVE": "Tending to disperse. Dispersive power (Opt.), the relativeeffect of a material in separating the different rays of light byrefraction, as when the substance is formed into a prism.-- Dis*pers\"ive*ness, n.",
    "DISPERSONATE": "To deprive of personality or individuality. [R.]We multiply; we dispersonate ourselves. Hare.",
    "DISPIRITED": "Depressed in spirits; disheartened; daunted.-- Dis*pir\"it*ed*ly, adv.-- Dis*pir\"it*ed, n.",
    "DISPIRITMENT": "Depression of spirits; discouragement. [R.]Procter, in evident distress and dispiritment, was waiting the slowconclusion of this. Carlyle.",
    "DISPITEOUS": "Full of despite; cruel; spiteful; pitiless. Spenser.-- Dis*pit\"e*ous*ly, adv. [Obs.]",
    "DISPLACEABLE": "Capable of being displaced.",
    "DISPLACEMENT": "The process of extracting soluble substances from organicmaterial and the like, whereby a quantity of saturated solvent isdisplaced, or removed, for another quantity of the solvent. Pistondisplacement (Mech.), the volume of the space swept through, orweight of steam, water, etc., displaced, in a given time, by thepiston of a steam engine or pump.",
    "DISPLACENCY": "Want of complacency or gratification; envious displeasure;dislike. [Obs.] Sir T. Browne.",
    "DISPLACER": "The funnel part of the apparatus for solution by displacement.",
    "DISPLANTATION": "The act of displanting; removal; displacement. Sir W. Raleigh.",
    "DISPLAT": "To untwist; to uncurl; to unplat. [Obs.] Hakewill.",
    "DISPLAY": "To extend the front of (a column), bringing it into line.Farrow.",
    "DISPLAYED": "With wings expanded; -- said of a bird of pray, esp. an eagle.",
    "DISPLAYER": "One who, or that which, displays.",
    "DISPLE": "To discipline; to correct. [Obs.]And bitter Penance, with an iron whip, Was wont him once to displeevery day. Spenser.",
    "DISPLEASANCE": "Displeasure; discontent; annoyance. [Obs.] Chaucer.",
    "DISPLEASANT": "Unpleasing; offensive; unpleasant. [Obs.] Speed.-- Dis*pleas\"ant*ly, adv. [Obs.] Strype.-- Dis*pleas\"ant*ness, n. [Obs.]",
    "DISPLEASE": "To give displeasure or offense. [Obs.]",
    "DISPLEASEDLY": "With displeasure. [R.]",
    "DISPLEASEDNESS": "Displeasure. [R.] South.",
    "DISPLEASER": "One who displeases.",
    "DISPLEASING": "Causing displeasure or dissatisfaction; offensive;disagreeable.-- Dis*pleas\"ing*ly, adv.-- Dis*pleas\"ing*ness, n. Locke.",
    "DISPLEASURE": "To displease. [Obs.] Bacon.",
    "DISPLENISH": "To deprive or strip, as a house of furniture, or a barn ofstock. [Scot.]",
    "DISPLODE": "To discharge; to explode.In posture to displode their second tire Of thunder. Milton.",
    "DISPLOSION": "Explosion.The vast displosion dissipates the clouds. Young.",
    "DISPLOSIVE": "Explosive.",
    "DISPLUME": "To strip of, or as of, a plume, or plumes; to deprive ofdecoration; to dishonor; to degrade.Displumed, degraded, and metamorphosed. Burke.",
    "DISPOLINE": "One of several isomeric organic bases of the quinoline seriesof alkaloids.",
    "DISPOND": "See Despond.",
    "DISPONDEE": "A double spondee; a foot consisting of four long syllables.",
    "DISPONE": "To dispose.",
    "DISPONEE": "The person to whom any property is legally conveyed.",
    "DISPONER": "One who legally transfers property from himself to another.",
    "DISPONGE": "To sprinkle, as with water from a sponge. [Poetic & Rare][Written also dispunge.]O sovereign mistress of true melancholy, The poisonous damp of nightdisponge upon me. Shak.",
    "DISPOPE": "To refuse to consider as pope; to depose from the popedom.One whom they disposed. Tennyson.",
    "DISPOROUS": "Having two spores.",
    "DISPORT": "Play; sport; pastime; diversion; playfulness. Milton.",
    "DISPORTMENT": "Act of disporting; diversion; play. [Obs.] Dr. H. More.",
    "DISPOSABLE": "Subject to disposal; free to be used or employed as occasionmay require; not assigned to any service or use.The great of this kingdom . . . has easily afforded a disposablesurplus. Burke.",
    "DISPOSE": "To bargain; to make terms. [Obs.]She had disposed with Cæsar. Shak.",
    "DISPOSEDNESS": "The state of being disposed or inclined; inclination;propensity. [R.]",
    "DISPOSEMENT": "Disposal. [Obs.] Goodwin.",
    "DISPOSER": "One who, or that which, disposes; a regulator; a director; abestower.Absolute lord and disposer of all things. Barrow.",
    "DISPOSINGLY": "In a manner to dispose.",
    "DISPOSITED": "Disposed. [Obs.] Glanvill.",
    "DISPOSITIONAL": "Pertaining to disposition.",
    "DISPOSITIONED": "Having (such) a disposition; -- used in compounds; as, well-dispositioned.",
    "DISPOSITIVELY": "In a dispositive manner; by natural or moral disposition.[Obs.] Sir T. Browne.Do dispositively what Moses is recorded to have done literally, . . .break all the ten commandments at once. Boyle.",
    "DISPOSITOR": "The planet which is lord of the sign where another planet is.[Obs.] Crabb.",
    "DISPOSSESS": "To put out of possession; to deprive of the actual occupancyof, particularly of land or real estate; to disseize; to eject; --usually followed by of before the thing taken away; as, to dispossessa king of his crown.Usurp the land, and dispossess the swain. Goldsmith.",
    "DISPOSSESSION": "The putting out of possession, wrongfully or otherwise, of onewho is in possession of a freehold, no matter in what title; --called also ouster.",
    "DISPOSSESSOR": "One who dispossesses. Cowley.",
    "DISPOST": "To eject from a post; to displace. [R.] Davies (Holy Roode).",
    "DISPRAISABLE": "Blamable. [R.]",
    "DISPRAISE": "To withdraw praise from; to notice with disapprobation or somedegree of censure; to disparage; to blame.Dispraising the power of his adversaries. Chaucer.I dispraised him before the wicked, that the wicked might not fall inlove with him. Shak.",
    "DISPRAISER": "One who blames or dispraises.",
    "DISPRAISINGLY": "By way of dispraise.",
    "DISPREAD": "To spread abroad, or different ways; to spread apart; to open;as, the sun dispreads his beams. Spenser.",
    "DISPREADER": "One who spreads abroad.Dispreaders both of vice and error. Milton.",
    "DISPREJUDICE": "To free from prejudice. [Obs.] W. Montagu.",
    "DISPREPARE": "To render unprepared. [Obs.] Hobbes.",
    "DISPRINCE": "To make unlike a prince. [R.]For I was drench'd with ooze, and torn with briers, . . . And, allone rag, disprinced from head to heel. Tennyson.",
    "DISPRISON": "To let loose from prison, to set all liberty. [R.] Bulwer.",
    "DISPRIVILEGE": "To deprive of a privilege or privileges. [R.]",
    "DISPRIZE": "To do preciate. [R.] Cotton (Ode to Lydia).",
    "DISPROFESS": "To renounce the profession or pursuit of.His arms, which he had vowed to disprofess. Spenser.",
    "DISPROFIT": "Loss; damage. Foxe.",
    "DISPROFITABLE": "Unprofitable. [Obs.]",
    "DISPROOF": "A proving to be false or erroneous; confutation; refutation;as, to offer evidence in disproof of a statement.I need not offer anything farther in support of one, or in disproofof the other. Rogers.",
    "DISPROPERTY": "To cause to be no longer property; to dispossess of. [R.] Shak.",
    "DISPROPORTION": "To make unsuitable in quantity, form, or fitness to an end; toviolate symmetry in; to mismatch; to join unfitly.To shape my legs of an unequal size; To disproportion me in everypart. Shak.A degree of strength altogether disproportioned to the extent of itsterritory. Prescott.",
    "DISPROPORTIONABLE": "Disproportional; unsuitable in form, size, quantity, oradaptation; disproportionate; inadequate.-- Dis`pro*por\"tion*a*ble*ness, n. Hammond.-- Dis`pro*por\"tion*a*bly, adv.",
    "DISPROPORTIONAL": "Not having due proportion to something else; not havingproportion or symmetry of parts; unsuitable in form, quantity orvalue; inadequate; unequal; as, a disproportional limb constitutesdeformity in the body; the studies of youth should not bedisproportional to their understanding.",
    "DISPROPORTIONALITY": "The state of being disproportional. Dr. H. More.",
    "DISPROPORTIONALLY": "In a disproportional manner; unsuitably in form, quantity, orvalue; unequally.",
    "DISPROPORTIONATE": "Not proportioned; unsymmetrical; unsuitable to something elsein bulk, form, value, or extent; out of proportion; inadequate; as,in a perfect body none of the limbs are disproportionate; it iswisdom not to undertake a work disproportionate means.-- Dis`pro*por\"tion*ate*ly, adv.-- Dis`pro*por\"tion*ate*ness, n.",
