    "DISQUISITION": "A formal or systematic inquiry into, or discussion of, anysubject; a full examination or investigation of a matter, with thearguments and facts bearing upon it; elaborate essay; dissertation.For accurate research or grave disquisition he was not wellqualified. Macaulay.",
