    "DISSATISFACTION": "The state of being dissatisfied, unsatisfied, or discontented;uneasiness proceeding from the want of gratification, or fromdisappointed wishes and expectations.The ambitious man has little happiness, but is subject to muchuneasiness and dissatisfaction. Addison.",
    "DISSATISFACTORY": "Causing dissatisfaction; unable to give content;unsatisfactory; displeasing.To have reduced the different qualifications in the different Statesto one uniform rule, would probably have been as dissatisfactory tosome of the States, as difficult for the Convention. A. Hamilton.-- Dis*sat`is*fac\"to*ri*ness, n.",
    "DISSATISFY": "To render unsatisfied or discontented; to excite uneasiness inby frustrating wishes or expectations; to displease by the want ofsomething requisite; as, to be dissatisfied with one's fortune.The dissatisfied factions of the autocracy. Bancroft.",
    "DISSEAT": "To unseat. [R.] Shak.",
    "DISSECT": "To divide into separate parts; to cut in pieces; to separateand expose the parts of, as an animal or a plant, for examination andto show their structure and relations; to anatomize.",
