    "DOME": "A cupola formed on a large scale.",
    "DOMEBOOK": "A book said to have been compiled under the direction of KingAlfred. It is supposed to have contained the principal maxims of thecommon law, the penalties for misdemeanors, and the forms of judicialproceedings. Domebook was probably a general name for book ofjudgments. Burrill.",
    "DOMED": "Furnished with a dome; shaped like a dome.",
    "DOMESDAY": "A day of judgment. See Doomsday. [Obs.] Domesday Book, theancient record of the survey of most of the lands of England, made byorder of William the Conqueror, about 1086. It consists of twovolumes, a large folio and a quarto, and gives the proprietors'tenures, arable land, woodland, etc. [Written also Doomsday Book.]",
    "DOMESMAN": "A judge; an umpire. [Obs.]",
