    "DORMANT": "In a sleeping posture; as, a lion dormant; -- distinguishedfrom couchant. Dormant partner (Com.), a partner who takes no sharein the active business of a company or partnership, but is entitledto a share of the profits, and subject to a share in losses; --called also sleeping or silent partner.-- Dormant window (Arch.), a dormer window. See Dormer.-- Table dormant, a stationary table. [Obs.] Chaucer.",
    "DORMITIVE": "Causing sleep; as, the dormitive properties of opium. Clarke.-- n. (Med.)",
    "DORMOUSE": "A small European rodent of the genus Myoxus, of severalspecies. They live in trees and feed on nuts, acorns, etc.; -- socalled because they are usually torpid in winter.",
