    "DRAW-CUT": "A single cut with a knife.",
    "DRAWABLE": "Capable of being drawn.",
    "DRAWBACK": "Money paid back or remitted; especially, a certain amount ofduties or customs, sometimes the whole, and sometimes only a part,remitted or paid back by the government, on the exportation of thecommodities on which they were levied. M",
    "DRAWBENCH": "A machine in which strips of metal are drawn through adrawplate; especially, one in which wire is thus made; -- also calleddrawing bench.",
    "DRAWBOLT": "A coupling pin. See under Coupling.",
    "DRAWBORE": "A hole bored through a tenon nearer to the shoulder than theholes through the cheeks are to the edge or abutment against whichthe shoulder is to rest, so that a pin or bolt, when driven into it,will draw these parts together. Weale.",
    "DRAWBOY": "A boy who operates the harness cords of a hand loom; also, apart of power loom that performs the same office.",
    "DRAWBRIDGE": "A bridge of which either the whole or a part is made to beraised up, let down, or drawn or turned aside, to admit or hindercommunication at pleasure, as before the gate of a town or castle, orover a navigable river or canal.",
    "DRAWCANSIR": "A blustering, bullying fellow; a pot-valiant braggart; a bully.The leader was of an ugly look and gigantic stature; he acted like adrawcansir, sparing neither friend nor foe. Addison.",
    "DRAWEE": "The person on whom an order or bill of exchange is drawn; --the correlative of drawer.",
    "DRAWER": "An under-garment worn on the lower limbs. Chest of drawers. Seeunder Chest.",
    "DRAWFILING": "The process of smooth filing by working the file sidewiseinstead of lengthwise.",
    "DRAWGEAR": "The means or parts by which cars are connected to be drawn.",
    "DRAWGLOVES": "An old game, played by holding up the fingers. Herrick.",
    "DRAWHEAD": "The flanged outer end of a drawbar; also, a name applied to thedrawgear.",
    "DRAWING": "The process of pulling out and elongating the sliver from thecarding machine, by revolving rollers, to prepare it for spinning.",
    "DRAWL": "To utter in a slow, lengthened tone.",
    "DRAWLATCH": "A housebreaker or thief. [Obs.] Old Play (1631).",
    "DRAWLING": "The act of speaking with a drawl; a drawl.-- Drawl\"ing*ly, adv. Bacon.",
    "DRAWLINK": "Same as Drawbar (b).",
    "DRAWN": "See Draw, v. t. & i. Drawn butter, butter melter and preparedto be used as a sort of gravy.-- Drawn fowl, an eviscerated fowl.-- Drawn game or battle, one in which neither party wins; oneequally contested.-- Drawn fox, one driven from cover. Shak.-- Drawn work, ornamental work made by drawing out threads from finecloth, and uniting the cross threads, to form a pattern.",
    "DRAWNET": "A net for catching the larger sorts of birds; also, a dragnet.Crabb.",
    "DRAWPLATE": "A hardened steel plate having a hole, or a gradation of conicalholes, through which wires are drawn to be reduced and elongated.",
    "DRAWROD": "A rod which unites the drawgear at opposite ends of the car,and bears the pull required to draw the train.",
    "DRAWSHAVE": "See Drawing knife.",
    "DRAWSPRING": "The spring to which a drawbar is attached.",
    "DRAY": "A squirrel's nest. Cowper.",
    "DRAYMAN": "A man who attends a dray.",
    "DRAZEL": "A slut; a vagabond wench. Same as Drossel. [Obs.] Hudibras.",
    "DREAD": "To fear in a great degree; to regard, or look forward to, withterrific apprehension.When at length the moment dreaded through so many years came close,the dark cloud passed away from Johnson's mind. Macaulay.",
    "DREAD-BOLTED": "Armed with dreaded bolts. \"Dread-bolted thunder.\" [Poetic]Shak.",
    "DREADABLE": "Worthy of being dreaded.",
    "DREADER": "One who fears, or lives in fear.",
    "DREADFULLY": "In a dreadful manner; terribly. Dryden.",
    "DREADFULNESS": "The quality of being dreadful.",
    "DREADINGLY": "With dread. Warner.",
    "DREADLESS": "Without doubt. [Obs.] Chaucer.",
    "DREADLESSNESS": "Freedom from dread.",
    "DREADLY": "Dreadful. [Obs.] \"Dreadly spectacle.\" Spenser.-- adv.",
    "DREAM": "To have a dream of; to see, or have a vision of, in sleep, orin idle fancy; -- often followed by an objective clause.Your old men shall dream dreams. Acts ii. 17.At length in sleep their bodies they compose, And dreamt the futurefight. Dryden.And still they dream that they shall still succeed. Cowper.To dream away, out, through, etc., to pass in revery or inaction; tospend in idle vagaries; as, to dream away an hour; to dream throughlife. \" Why does Antony dream out his hours\" Dryden.",
    "DREAMFUL": "Full of dreams. \" Dreamful ease.\" Tennyson.-- Dream\"ful*ly, adv.",
    "DREAMILY": "As if in a dream; softly; slowly; languidly. Longfellow.",
    "DREAMINESS": "The state of being dreamy.",
    "DREAMINGLY": "In a dreamy manner.",
    "DREAMLAND": "An unreal, delightful country such as in sometimes pictured indreams; region of fancies; fairyland.[He] builds a bridge from dreamland for his lay. Lowell.",
    "DREAMLESS": "Free from, or without, dreams. Camden.-- Dream\"less*ly, adv.",
    "DREAMY": "Abounding in dreams or given to dreaming; appropriate to, orlike, dreams; visionary. \"The dreamy dells.\" Tennyson.",
    "DREAR": "Dismal; gloomy with solitude. \"A drear and dying sound.\"Milton.",
    "DREARILY": "Gloomily; dismally.",
    "DREARIMENT": "Dreariness. [Obs.] Spenser.",
    "DREARING": "Sorrow. [Obs.] Spenser.",
    "DREARISOME": "Very dreary. Halliwell.",
    "DRECCHE": "To delay. [Obs.] Gower.",
    "DREDGE": "Very fine mineral matter held in suspension in water. Raymond.",
    "DREDGER": "A box with holes in its lid; -- used for sprinkling flour, ason meat or a breadboard; -- called also dredging box, drudger, anddrudging box.",
    "DREE": "To endure; to suffer. [Scot.]",
    "DREG": "Corrupt or defiling matter contained in a liquid, orprecipitated from it; refuse; feculence; lees; grounds; sediment;hence, the vilest and most worthless part of anything; as, the dregsof society.We, the dregs and rubbish of mankind. Dryden.",
    "DREGGINESS": "Fullness of dregs or lees; foulness; feculence.",
    "DREGGISH": "Foul with lees; feculent. Harvey.",
    "DREGGY": "Containing dregs or lees; muddy; foul; feculent. Boyle.",
    "DREIBUND": "A triple alliance; specif., the alliance of Germany, Austria,and Italy, formed in 1882.",
    "DREIN": "To drain. [Obs.] Congreve.",
    "DREISSENA": "A genus of bivalve shells of which one species (D. polymorpha)is often so abundant as to be very troublesome in the fresh waters ofEurope.",
    "DRENCH": "A drink; a draught; specifically, a potion of medicine pouredor forced down the throat; also, a potion that causes purging. \"Adrench of wine.\" Dryden.Give my roan horse a drench. Shak.",
    "DRENCHE": "To drown. [Obs.]In the sea he drenched. Chaucer.",
    "DRENGAGE": "The tenure by which a drench held land. [Obs.] Burrill.",
    "DRENT": "Drenched; drowned. [Obs.] \"Condemned to be drent.\" Spenser.",
    "DRESDEN WARE": "A superior kind of decorated porcelain made near Dresden inSaxony.",
    "DRESS": "To arrange in exact continuity of line, as soldiers; commonlyto adjust to a straight line and at proper distance; to align; as, todress the ranks.",
    "DRESS CIRCLE": "A gallery or circle in a theater, generally the first above thefloor, in which originally dress clothes were customarily worn.",
    "DRESS COAT": "A coat with skirts behind only, as distinct from the frockcoat, of which the skirts surround the body. It is worn on occasionsof ceremony. The dress coat of officers of the United States army isa full-skirted frock coat.",
    "DRESS GOODS": "A term applied to fabrics for the gowns of women and girls; --most commonly to fabrics of mixed materials, but also applicable tosilks, printed linens, and calicoes.",
    "DRESSER": "A kind of pick for shaping large coal.",
    "DRESSINESS": "The state of being dressy.",
    "DRESSING": "An application (a remedy, bandage, etc.) to a sore or wound.Wiseman.",
    "DRESSMAKER": "A maker of gowns, or similar garments; a mantuamaker.",
    "DRESSMAKING": "The art, process, or occupation, of making dresses.",
    "DRESSY": "Showy in dress; attentive to dress.A dressy flaunting maidservant. T. Hook.A neat, dressy gentleman in black. W. Irving.",
    "DREST": "of Dress.",
    "DRETCH": "See Drecche. [Obs.]",
    "DREUL": "To drool. [Obs.]",
    "DREVIL": "A fool; a drudge. See Drivel.",
    "DREW": "of Draw.",
    "DREY": "A squirrel's nest. See Dray. [Obs.]",
    "DREYE": "Dry. [Obs.] Chaucer.",
    "DRIB": "To do by little and little; as:(a) To cut off by a little at a time; to crop.(b) To appropriate unlawfully; to filch; to defalcate.He who drives their bargain dribs a part. Dryden.",
    "DRIBBER": "One who dribs; one who shoots weakly or badly. [Obs.] Ascham.",
    "DRIBBLE": "To let fall in drops.Let the cook . . . dribble it all the way upstairs. Swift.",
    "DRIBBLER": "One who dribbles.",
    "DRIE": "To endure. [Obs.]So causeless such drede for to drie. Chaucer.",
    "DRIED": "of Day. Also adj.; as, dried apples.",
    "DRIER": "Drying oil; a substance mingled with the oil used in oilpainting to make it dry quickly.",
    "DRIFT": "The horizontal thrust or pressure of an arch or vault upon theabutments. [R.] Knight.",
    "DRIFTBOLT": "A bolt for driving out other bolts.",
    "DRIFTLESS": "Having no drift or direction; without aim; purposeless.",
    "DRIFTPIECE": "An upright or curved piece of timber connecting the plank sheerwith the gunwale; also, a scroll terminating a rail.",
    "DRIFTPIN": "A smooth drift. See Drift, n., 9.",
    "DRIFTWAY": "Same as Drift, 11.",
    "DRIFTWEED": "Seaweed drifted to the shore by the wind. Darwin.",
    "DRIFTWIND": "A driving wind; a wind that drives snow, sand, etc., intoheaps. Beau. & Fl.",
    "DRIFTY": "Full of drifts; tending to form drifts, as snow, and the like.",
    "DRILL": "To practice an exercise or exercises; to train one's self.",
    "DRILL PRESS": "A machine for drilling holes in metal, the drill being pressedto the metal by the action of a screw.",
    "DRILLER": "One who, or that which, drills.",
    "DRILLING": "The act of using a drill in sowing seeds.",
    "DRILLMASTER": "One who teaches drill, especially in the way of gymnastics.Macaulay.",
    "DRILLSTOCK": "A contrivance for holding and turning a drill. Knight.",
    "DRILY": "See Dryly. Thackeray.",
    "DRIMYS": "A genus of magnoliaceous trees. Drimys aromatica furnishesWinter's bark.",
    "DRINKABLE": "Capable of being drunk; suitable for drink; potable. Macaulay.Also used substantively, esp. in the plural. Steele.",
    "DRINKABLENESS": "State of being drinkable.",
    "DRINKER": "One who drinks; as, the effects of tea on the drinker; also,one who drinks spirituous liquors to excess; a drunkard. Drinker moth(Zoöl.), a large British moth (Odonestis potatoria).",
    "DRINKLESS": "Destitute of drink. Chaucer.",
    "DRIP": "To let fall in drops.Which from the thatch drips fast a shower of rain. Swift.",
    "DRIPPLE": "Weak or rare. [Obs.]",
    "DRIPSTONE": "A drip, when made of stone. See Drip, 2.",
    "DRIVE": "To dig Horizontally; to cut a horizontal gallery or tunnel.Tomlinson.",
    "DRIVEBOLT": "A drift; a tool for setting bolts home.",
    "DRIVEL": "To be weak or foolish; to dote; as, a driveling hero; drivelinglove. Shak. Dryden.",
    "DRIVELER": "A slaverer; a slabberer; an idiot; a fool. [Written alsodriveller.]",
    "DRIVEN": "of Drive. Also adj. Driven well, a well made by driving a tubeinto the earth to an aqueous stratum; -- called also drive well.",
    "DRIVEPIPE": "A pipe for forcing into the earth.",
    "DRIVER": "A part that transmits motion to another part by contact withit, or through an intermediate relatively movable part, as a gearwhich drives another, or a lever which moves another through a link,etc. Specifically:(a) The driving wheel of a locomotive.(b) An attachment to a lathe, spindle, or face plate to turn acarrier.(c) A crossbar on a grinding mill spindle to drive the upper stone.",
    "DRIVEWAY": "A passage or way along or through which a carriage may bedriven.",
    "DRIZZLE": "To rain slightly in very small drops; to fall, as water fromthe clouds, slowly and in fine particles; as, it drizzles; drizzlingdrops or rain. \"Drizzling tears.\" Spenser.",
    "DRIZZLY": "Characterized by small rain, or snow; moist and disagreeable.\"Winter's drizzly reign.\" Dryden.",
    "DROCK": "A water course. [Prov. Eng.]",
    "DROGHER": "A small craft used in the West India Islands to take offsugars, rum, etc., to the merchantmen; also, a vessel fortransporting lumber, cotton, etc., coastwise; as, a lumber drogher.[Written also droger.] Ham. Nar. Encyc.",
    "DROGUE": "See Drag, n.,",
    "DROH": "of Draw. [Obs.] Chaucer.",
    "DROIL": "To work sluggishly or slowly; to plod. [Obs.]",
    "DROIT": "A right; law in its aspect of the foundation of rights; also,in old law, the writ of right. Abbott. Droit d'aubaine. See underAubaine.-- Droits of the Admiralty (Eng. Law), rights or perquisites of theAdmiralty, arising from seizure of an enemy's ships in port on thebreaking out of war, or those coming into port in ignorance ofhostilities existing, or from such ships as are taken bynoncommissioned captors; also, the proceeds of wrecks, and derelictproperty at sea. The droits of admiralty are now paid into theExchequer for the public benefit.",
    "DROITURAL": "relating to the mere right of property, as distinguished fromthe right of possession; as, droitural actions. [Obs.] Burrill.",
    "DROITZSCHKA": "See Drosky.",
    "DROLL": "Queer, and fitted to provoke laughter; ludicrous from oddity;amusing and strange.",
    "DROLLER": "A jester; a droll. [Obs.] Glanvill.",
    "DROLLINGLY": "In a jesting manner.",
    "DROLLISH": "Somewhat droll. Sterne.",
    "DROLLIST": "A droll. [R.] Glanvill.",
    "DROMAEOGNATHOUS": "Having the structure of the palate like that of the ostrich andemu.",
    "DROMATHERIUM": "A small extinct triassic mammal from North Carolina, theearliest yet found in America.",
    "DROME": "The crab plover (Dromas ardeola), a peculiar North Africanbird, allied to the oyster catcher.",
    "DROMEDARY": "The Arabian camel (Camelus dromedarius), having one hump orprotuberance on the back, in distinction from the Bactrian camel,which has two humps.",
    "DRONE": "The male of bees, esp. of the honeybee. It gathers no honey.See Honeybee.All with united force combine to drive The lazy drones from thelaborious hive. Dryden.",
    "DRONE BEE": "The male of the honeybee; a drone.",
    "DRONE FLY": "A dipterous insect (Eristalis tenax), resembling the drone bee.See Eristalis.",
    "DRONEPIPE": "One of the low-toned tubes of a bagpipe.",
    "DRONGO": "A passerine bird of the family Dicruridæ. They are usuallyblack with a deeply forked tail. They are natives of Asia, Africa,and Australia; -- called also drongo shrikes.",
    "DRONISH": "Like a drone; indolent; slow. Burke.-- Dron\"ish*ly, adv.-- Dron\"ish*ness, n.",
    "DRONKELEWE": "Given to drink; drunken. [Obs.] Chaucer.",
    "DRONTE": "The dodo.",
    "DRONY": "Like a drone; sluggish; lazy.",
    "DROOL": "To drivel, or drop saliva; as, the child drools.His mouth drooling with texts. T. Parker.",
    "DROOP": "To let droop or sink. [R.] M. Arnold.Like to a withered vine That droops his sapless branches to theground. Shak.",
    "DROOPER": "One who, or that which, droops.",
    "DROOPINGLY": "In a drooping manner.",
    "DROP": "Any medicine the dose of which is measured by drops; as,lavender drops.",
    "DROPLET": "A little drop; a tear. Shak.",
    "DROPLIGHT": "An apparatus for bringing artificial light down from achandelier nearer to a table or desk; a pendant.",
    "DROPPER": "A branch vein which drops off from, or leaves, the main lode.",
    "DROPPING": "That which falls in drops; the excrement or dung of animals.Dropping bottle, an instrument used to supply small quantities of afluid to a test tube or other vessel.-- Dropping fire, a continued irregular discharge of firearms.-- Dropping tube, a tube for ejecting any liquid in drops.",
    "DROPPINGLY": "In drops.",
    "DROPSICALNESS": "State of being dropsical.",
    "DROPSIED": "Diseased with drops. Shak.",
    "DROPSY": "An unnatural collection of serous fluid in any serous cavity ofthe body, or in the subcutaneous cellular tissue. Dunglison.",
    "DROPT": "imp. & p. p. of Drop, v. G. Eliot.",
    "DROPWISE": "After the manner of a drop; in the form of drops.Trickling dropwise from the cleft. Tennyson.",
    "DROPWORM": "The larva of any geometrid moth, which drops from trees bymeans of a thread of silk, as the cankerworm.",
    "DROPWORT": "An Old World species of Spiræa (S. filipendula), with finelycut leaves.",
    "DROSERA": "A genus of low perennial or biennial plants, the leaves ofwhich are beset with gland-tipped bristles. See Sundew. Gray.",
    "DROSKY": "A low, four-wheeled, open carriage, used in Russia, consistingof a kind of long, narrow bench, on which the passengers ride as on asaddle, with their feet reaching nearly to the ground. Other kinds ofvehicles are now so called, esp. a kind of victoria drawn by one ortwo horses, and used as a public carriage in German cities. [Writtenalso droitzschka, and droschke.]",
    "DROSOMETER": "An instrument for measuring the quantity of dew on the surfaceof a body in the open air. It consists of a balance, having a plateat one end to receive the dew, and at the other a weight protectedfrom the deposit of dew.",
    "DROSSEL": "A slut; a hussy; a drazel. [Obs.] Warner.",
    "DROSSLESS": "Free from dross. Stevens.",
    "DROSSY": "Of, pertaining to, resembling, dross; full of dross; impure;worthless. \" Drossy gold.\" Dryden. \"Drossy rhymes.\" Donne.-- Dross\"i*ness, n.",
    "DROTCHEL": "See Drossel. [Obs.]",
    "DROUGH": "of Draw. [Obs.] Chaucer.",
    "DROUGHTINESS": "A state of dryness of the weather; want of rain.",
    "DROUMY": "Troubled; muddy. [Obs.] Bacon.",
    "DROUTH": "Same as Drought. Sandys.Another ill accident is drouth at the spindling of corn. Bacon.One whose drouth [thirst], Yet scarce allayed, still eyes the currentstream. Milton.In the dust and drouth of London life. Tennyson.",
    "DROUTHY": "Droughty.",
    "DROVE": "of Drive.",
    "DROVEN": "of Drive. [Obs.]",
    "DROVY": "Turbid; muddy; filthy. [Obs.] Chaucer.",
    "DROW": "of Draw. [Obs.] Chaucer.",
    "DROWN": "To be suffocated in water or other fluid; to perish in water.Methought, what pain it was to drown. Shak.",
    "DROWNAGE": "The act of drowning. [R.]",
    "DROWNER": "One who, or that which, drowns.",
    "DROWSE": "To sleep imperfectly or unsoundly; to slumber; to be heavy withsleepiness; to doze. \"He drowsed upon his couch.\" South.In the pool drowsed the cattle up to their knees. Lowell.",
    "DROWSIHEAD": "Drowsiness. Thomson.",
    "DROWSIHED": "Drowsihead. [Obs.] Spenser.",
    "DROWSILY": "In a drowsy manner.",
    "DROWSINESS": "State of being drowsy. Milton.",
    "DROWTH": "See Drought. Bacon.",
    "DROYLE": "See Droil. [Obs.] Spenser.",
    "DRUB": "To beat with a stick; to thrash; to cudgel.Soundly Drubbed with a good honest cudgel. L'Estrange.",
    "DRUBBER": "One who drubs. Sir W. Scott.",
    "DRUDGE": "To perform menial work; to labor in mean or unpleasant officeswith toil and fatigue.He gradually rose in the estimation of the booksellers for whom hedrudged. Macaulay.",
    "DRUDGERY": "The act of drudging; disagreeable and wearisome labor; ignobleor slavish toil.The drudgery of penning definitions. Macaulay.Paradise was a place of bliss . . . without drudgery and with outsorrow. Locke.",
    "DRUDGING BOX": "See Dredging box.",
    "DRUDGINGLY": "In a drudging manner; laboriously.",
    "DRUERY": "Courtship; gallantry; love; an object of love. [Obs.] Chaucer.",
    "DRUG": "To drudge; to toil laboriously. [Obs.] \"To drugge and draw.\"Chaucer.",
    "DRUGGER": "A druggist. [Obs.] Burton.",
    "DRUGGIST": "One who deals in drugs; especially, one who buys and sellsdrugs without compounding them; also, a pharmaceutist or apothecary.",
    "DRUGSTER": "A druggist. [Obs.] Boule.",
    "DRUIDESS": "A female Druid; a prophetess.",
    "DRUIDISH": "Druidic.",
    "DRUIDISM": "The system of religion, philosophy, and instruction, receivedand taught by the Druids; the rites and ceremonies of the Druids.",
    "DRUM": "An instrument of percussion, consisting either of a hollowcylinder, over each end of which is stretched a piece of skin orvellum, to be beaten with a stick; or of a metallic hemisphere(kettledrum) with a single piece of skin to be so beaten; the commoninstrument for marking time in martial music; one of the pair oftympani in an orchestra, or cavalry band.The drums cry bud-a-dub. Gascoigne.",
    "DRUM MAJOR": ".",
    "DRUM WINDING": "A method of armature winding in which the wire is wound uponthe outer surface of a cylinder or drum from end to end of thecylinder; -- distinguished from ring winding, etc.",
    "DRUMBEAT": "The sound of a beaten drum; drum music.Whose morning drumbeat, following the sun, and keeping company withthe hours, circles the earth with one continuous and unbroken strainof the martial airs of England. D. Webster.",
    "DRUMFISH": "any fish of the family Sciænidæ, which makes a loud noise bymeans of its air bladder; -- called also drum.",
    "DRUMLIN": "A hill of compact, unstratified, glacial drift or till, usuallyelongate or oval, with the larger axis parallel to the former localglacial motion.",
    "DRUMLY": "Turbid; muddy. [Scot. & Obs. or Prov. Eng.] Wodroephe (1623).Burns.",
    "DRUMMER": "A fish that makes a sound when caught; as:(a) The squeteague.(b) A California sculpin.",
    "DRUMMING": "The act of beating upon, or as if upon, a drum; also, the noisewhich the male of the ruffed grouse makes in spring, by beating hiswings upon his sides.",
    "DRUMMOND LIGHT": "A very intense light, produced by turning two streams of gas,one oxygen and the other hydrogen, or coal gas, in a state ofignition, upon a ball of lime; or a stream of oxygen gas through aflame of alcohol upon a ball or disk of lime; -- called alsooxycalcium light, or lime light.",
    "DRUNK": "A drunken condition; a spree. [Slang]",
    "DRUNKARD": "One who habitually drinks strong liquors immoderately; onewhose habit it is to get drunk; a toper; a sot.The drunkard and glutton shall come to poverty. Prov. xxiii. 21.",
    "DRUNKENHEAD": "Drunkenness. [Obs.]",
    "DRUNKENLY": "In a drunken manner. [R.] Shak.",
    "DRUNKENNESS": "The state of being drunk; drunkenness. [Obs.] Gower.",
    "DRUPACEOUS": "Producing, or pertaining to, drupes; having the form of drupes;as, drupaceous trees or fruits.",
    "DRUPAL": "Drupaceous.",
    "DRUPE": "A fruit consisting of pulpy, coriaceous, or fibrous exocarp,without valves, containing a nut or stone with a kernel. The exocarpis succulent in the plum, cherry, apricot, peach, etc.; dry andsubcoriaceous in the almond; and fibrous in the cocoanut.",
    "DRUSE": "A cavity in a rock, having its interior surface studded withcrystals and sometimes filled with water; a geode.",
    "DRY": "Of certain morbid conditions, in which there is entire orcomparative absence of moisture; as, dry gangrene; dry catarrh.",
    "DRY DOCK": "See under Dock.",
    "DRY GOODS": "A commercial name for textile fabrics, cottons, woolens, linen,silks, laces, etc., -- in distinction from groceries. [U.S.]",
    "DRY NURSE": "A nurse who attends and feeds a child by hand; -- indistinction from a wet nurse, who suckles it.",
    "DRY-BEAT": "To beat severely. Shak.",
    "DRY-BONED": "Having dry bones, or bones without flesh.",
    "DRY-EYED": "Not having tears in the eyes.",
    "DRY-FISTED": "Niggardly.",
    "DRY-RUB": "To rub and cleanse without wetting. Dodsley.",
    "DRY-SHOD": "Without wetting the feet.",
    "DRY-STONE": "Constructed of uncemented stone. \"Dry-stone walls.\" Sir W.Scott.",
    "DRYAD": "A wood nymph; a nymph whose life was bound up with that of hertree.",
    "DRYANDRA": "A genus of shrubs growing in Australia, having beautiful, hard,dry, evergreen leaves.",
    "DRYAS": "A dryad.",
    "DRYER": "See Drier. Sir W. Temple.",
    "DRYFOOT": "The scent of the game, as far as it can be traced. [Obs.] Shak.",
    "DRYLY": "In a dry manner; not succulently; without interest; withoutsympathy; coldly.",
    "DRYNESS": "The state of being dry. See Dry.",
    "DRYNURSE": "To feed, attend, and bring up without the breast. Hudibras.",
    "DRYOBALANOPS": "The genus to which belongs the single species D. Camphora, alofty resinous tree of Borneo and Sumatra, yielding Borneo camphorand camphor oil.",
    "DRYSALTER": "A dealer in salted or dried meats, pickles, sauces, etc., andin the materials used in pickling, salting, and preserving variouskinds of food Hence drysalters usually sell a number of salinesubstances and miscellaneous drugs. Brande & C.",
    "DRYSALTERY": "The articles kept by a drysalter; also, the business of adrysalter.",
    "DUAD": "A union of two; duality. [R.] Harris.",
    "DUAL": "Expressing, or consisting of, the number two; belonging to two;as, the dual number of nouns, etc. , in Greek.Here you have one half of our dual truth. Tyndall.",
    "DUALIN": "An explosive substance consisting essentially of sawdust orwood pulp, saturated with nitroglycerin and other similar nitrocompounds. It is inferior to dynamite, and is more liable toexplosion.",
    "DUALISM": "State of being dual or twofold; a twofold division; any systemwhich is founded on a double principle, or a twofold distinction; as:(a) (Philos.) A view of man as constituted of two original andindependent elements, as matter and spirit. (Theol.)(b) A system which accepts two gods, or two original principles, onegood and the other evil.(c) The doctrine that all mankind are divided by the arbitrary decreeof God, and in his eternal foreknowledge, into two classes, the electand the reprobate.(d) (Physiol.) The theory that each cerebral hemisphere actsindependently of the other.An inevitable dualism bisects nature, so that each thing is a half,and suggests another thing to make it whole. Emerson.",
    "DUALISTIC": "Consisting of two; pertaining to dualism or duality. Dualisticsystem or theory (Chem.), the theory, originated by Lavoisier anddeveloped by Berzelius, that all definite compounds are binary intheir nature, and consist of two distinct constituents, themselvessimple or complex, and possessed of opposite chemical or electricalaffinities.",
    "DUALITY": "The quality or condition of being two or twofold; dualcharacter or usage.",
    "DUAN": "A division of a poem corresponding to a canto; a poem or song.[R.]",
    "DUARCHY": "Government by two persons.",
    "DUB": "To make a noise by brisk drumbeats. \"Now the drum dubs.\" Beau.& Fl.",
    "DUBB": "The Syrian bear. See under Bear. [Written also dhubb, and dub.]",
    "DUBBER": "One who, or that which, dubs.",
    "DUBIETY": "Doubtfulness; uncertainty; doubt. [R.] Lamb. \"The dubiety ofhis fate.\" Sir W. Scott.",
    "DUBIOSITY": "The state of being doubtful; a doubtful statement or thing.[R.]Men often swallow falsities for truths, dubiosities for certainties,possibilities for feasibilities. Sir T. Browne.",
    "DUBIOUSLY": "In a dubious manner.",
    "DUBIOUSNESS": "State of being dubious.",
    "DUBITABLE": "Liable to be doubted; uncertain. [R.] Dr. H. More.-- Du\"bi*ta*bly, adv. [R.]",
    "DUBITANCY": "Doubt; uncertainty. [R.] Hammond.",
    "DUBITATE": "To doubt. [R.]If he . . . were to loiter dubitating, and not come. Carlyle.",
    "DUBITATION": "Act of doubting; doubt. [R.] Sir T. Scott.",
    "DUBITATIVE": "Tending to doubt; doubtful. [R.] -- Du\"bi*ta*tive*ly, adv. [R.]. Eliot.",
    "DUBOISIA": "Same as Duboisine.",
    "DUBOISINE": "An alkaloid obtained from the leaves of an Australian tree(Duboisia myoporoides), and regarded as identical with hyoscyamine.It produces dilation of the pupil of the eye.",
    "DUCAL": "Of or pertaining to a duke.His ducal cap was to be exchanged for a kingly crown. Motley.",
    "DUCALLY": "In the manner of a duke, or in a manner becoming the rank of aduke.",
