    "DUCES TECUM": "A judicial process commanding a person to appear in court andbring with him some piece of evidence or other thing to be producedto the court.",
    "DUCHESS": "The wife or widow of a duke; also, a lady who has thesovereignty of a duchy in her own right.",
    "DUCHESSE LACE": "A beautiful variety of Brussels pillow lace made originally inBelgium and resembling Honiton guipure. It is worked with fine threadin large sprays, usually of the primrose pattern, with much raisedwork.",
    "DUCHY": "The territory or dominions of a duke; a dukedom.",
    "DUCK": "A pet; a darling. Shak.",
    "DUCK-BILLED": "Having a bill like that of a duck..",
    "DUCK-LEGGED": "Having short legs, like a waddling duck; short-legged. Dryden.",
    "DUCKBILL": "See Duck mole, under Duck, n.",
    "DUCKING": ", from Duck, v. t. & i. Ducking stool, a stool or chair inwhich common scolds were formerly tied, and plunged into water, as apunishment. See Cucking stool. The practice of ducking began in thelatter part of the 15th century, and prevailed until the early partof the 18th, and occasionally as late as the 19th century.Blackstone. Chambers.",
    "DUCKLING": "A young or little duck. Gay.",
    "DUCKWEED": "A genus (Lemna) of small plants, seen floating in greatquantity on the surface of stagnant pools fresh water, and supposedto furnish food for ducks; -- called also duckmeat.",
    "DUCT": "One of the vessels of an animal body by which the products ofglandular secretion are conveyed to their destination.",
    "DUCTIBLE": "Capable of being drawn out [R.] Feltham.",
    "DUCTILIMETER": "An instrument for accurately determining the ductility ofmetals.",
    "DUCTION": "Guidance. [Obs.] Feltham.",
    "DUCTLESS": "Having to duct or outlet; as, a ductless gland.",
    "DUCTOR": "A contrivance for removing superfluous ink or coloring matterfrom a roller. See Doctor, 4. Knight. Ductor roller (Printing), theroller which conveys or supplies ink to another roller. Knight.",
    "DUCTURE": "Guidance. [Obs.] South.",
    "DUDDER": "To confuse or confound with noise. Jennings.",
    "DUDDERY": "A place where rags are bought and kept for sale. [Eng.]",
    "DUDE": "A kind of dandy; especially, one characterized by anultrafashionable style of dress and other affectations. [Recent]The social dude who affects English dress and English drawl. TheAmerican.",
    "DUDEEN": "A short tobacco pipe. [Written also dudheen.] [Irish]",
    "DUDGEON": "Resentment; ill will; anger; displeasure.I drink it to thee in dudgeon and hostility.Sir T. Scott.",
    "DUDISH": "Like, or characterized of, a dude.",
    "DUE": "Directly; exactly; as, a due east course.",
    "DUEBILL": "A brief written acknowledgment of a debt, not made payable toorder, like a promissory note. Burrill.",
    "DUEFUL": "Fit; becoming. [Obs.] Spenser.",
    "DUEL": "A combat between two persons, fought with deadly weapons, byagreement. It usually arises from an injury done or an affront givenby one to the other. Trial by duel (Old Law), a combat between twopersons for proving a cause; trial by battel.",
    "DUELER": "One who engages in a duel. [R.] [Written also dueller.] South.",
    "DUELING": "e act or practice of fighting in single combat. Also adj.[Written also duelling.]",
    "DUELIST": "One who fights in single combat. [Written also duellist.]A duelist . . . always values himself upon his courage, his sense ofhonor, his fidelity and friendship. Hume.",
    "DUELO": "A duel; also, the rules of dueling. [Obs.] Shak.",
    "DUENESS": "Quality of being due; debt; what is due or becoming. T.Goodwin.",
    "DUET": "A composition for two performers, whether vocal orinstrumental.",
    "DUETTINO": "A duet of short extent and concise form.",
    "DUETTO": "See Duet.",
    "DUFFEL": "A kind of coarse woolen cloth, having a thick nap or frieze.[Written also duffle.]Good duffel gray and flannel fine. Wordsworth.",
    "DUFFEL BAG": "A sack to hold miscellaneous articles, as tools, supplies, orthe like.",
    "DUFFLE": "See Duffel.",
    "DUFRENITE": "A mineral of a blackish green color, commonly massive or innodules. It is a hydrous phosphate of iron.",
    "DUG": "A teat, pap, or nipple; -- formerly that of a human mother, nowthat of a cow or other beast.With mother's dug between its lips. Shak.",
    "DUGONG": "An aquatic herbivorous mammal (Halicore dugong), of the orderSirenia, allied to the manatee, but with a bilobed tail. It inhabitsthe Red Sea, Indian Ocean, East Indies, and Australia. [Written alsoduyong.]",
    "DUGWAY": "A way or road dug through a hill, or sunk below the surface ofthe land. [U.S.]",
    "DUKE": "To play the duke. [Poetic]Lord Angelo dukes it well in his absence. Shak.",
    "DUKELING": "A little or insignificant duke. Ford.",
    "DUKESHIP": "The quality or condition of being a duke; also, the personalityof a duke. Massinger.",
    "DULCAMARA": "A plant (Solanum Dulcamara). See Bittersweet, n.,",
    "DULCAMARIN": "A glucoside extracted from the bittersweet (Solanum Dulcamara),as a yellow amorphous substance. It probably occasions the compoundtaste. See Bittersweet, 3(a).",
    "DULCE": "To make sweet; to soothe. [Obs.]",
    "DULCENESS": "Sweetness. [Obs.] Bacon.",
    "DULCIANA": "A sweet-toned stop of an organ.",
    "DULCIFICATION": "The act of dulcifying or sweetening. Boyle.",
    "DULCIFIED": "Sweetened; mollified. Dulcified spirit or spirits, a compoundof alcohol with mineral acids; as, dulcified spirits of niter.",
    "DULCIFLUOUS": "Flowing sweetly. [R.]",
    "DULCIFY": "To sweeten; to free from acidity, saltness, or acrimony.Wiseman.",
    "DULCILOQUY": "A soft manner of speaking.",
    "DULCINEA": "A mistress; a sweetheart.I must ever have some Dulcinea in my head. Sterne.",
    "DULCINESS": "See Dulceness. [Obs.]",
    "DULCINO": "See Dolcino.",
    "DULCITE": "A white, sugarlike substance, C6H8.(OH)2, occurring naturallyin a manna from Madagascar, and in certain plants, and producedartificially by the reduction of galactose and lactose or milk sugar.",
    "DULCITUDE": "Sweetness. [R.] Cockeram.",
    "DULCORATE": "To sweeten; to make less acrimonious. [R.] Bacon.",
    "DULCORATION": "The act of sweetening. [R.] Bacon.",
    "DULEDGE": "One of the dowels joining the ends of the fellies which formthe circle of the wheel of a gun carriage. Wilhelm.",
    "DULIA": "An inferior kind of veneration or worship, given to the angelsand saints as the servants of God.",
    "DULL": "To become dull or stupid. Rom. of R.",
    "DULL-BRAINED": "Stupid; doltish. Shak.",
    "DULL-BROWED": "Having a gloomy look.",
    "DULL-EYED": "Having eyes wanting brightness, liveliness, or vivacity. Shak.",
    "DULL-SIGHTED": "Having poor eyesight.",
    "DULL-WITTED": "Stupid.",
    "DULLARD": "A stupid person; a dunce. Shak.-- a.",
    "DULLER": "One who, or that which, dulls.",
    "DULLHEAD": "A blockhead; a dolt. Ascham.",
    "DULLISH": "Somewhat dull; uninteresting; tiresome. \"A series of dullishverses.\" Prof. Wilson.",
    "DULLNESS": "The state of being dull; slowness; stupidity; heaviness;drowsiness; bluntness; obtuseness; dimness; want of luster; want ofvividness, or of brightness. [Written also dulness.]And gentle dullness ever loves a joke. Pope.",
    "DULLSOME": "Dull. [R.] Gataker.",
    "DULLY": "In a dull manner; stupidly; slowly; sluggishly; without life orspirit.Supinely calm and dully innocent. G. Lyttelton.",
    "DULOCRACY": "See Doulocracy.",
    "DULSE": "A seaweed of a reddish brown color, which is sometimes eaten,as in Scotland. The true dulse is Sarcophyllis edulis; the common isRhodymenia. [Written also dillisk.]The crimson leaf of the dulse is seen To blush like a banner bathedin slaughter. Percival.",
    "DULWILLY": "The ring plover. [Prov. Eng.]",
    "DULY": "In a due, fit, or becoming manner; as it (anything) ought tobe; properly; regularly.",
    "DUMAL": "Pertaining to, or set with, briers or bushes; brambly. [R.]",
    "DUMB": "To put to silence. [Obs.] Shak.",
    "DUMB-BELL": "A weight, consisting of two spheres or spheroids, connected bya short bar for a handle; used (often in pairs) for gymnasticexercise.",
    "DUMB-WAITER": "A framework on which dishes, food, etc., are passed from oneroom or story of a house to another; a lift for dishes, etc.; also, apiece of furniture with movable or revolving shelves.",
    "DUMBLEDOR": "A bumblebee; also, a cockchafer. [Prov. Eng.]",
    "DUMBLY": "In silence; mutely.",
    "DUMBNESS": "The quality or state of being dumb; muteness; silence;inability to speak.",
    "DUMDUM BULLET": "A kind of manstopping bullet; -- so named from Dumdum, inIndia, where bullets are manufactured for the Indian army.",
    "DUMETOSE": "Dumose.",
    "DUMFOUND": "To strike dumb; to confuse with astonishment. [Written alsodumbfound.] Spectator.",
    "DUMFOUNDER": "To dumfound; to confound. [Written also dumbfounder.]",
    "DUMMADOR": "A dumbledor.",
    "DUMMERER": "One who feigns dumbness. [Obs.] Burton.",
    "DUMMY": "One who plays a merely nominal part in any action; a shamcharacter.",
    "DUMP": "A thick, ill-shapen piece; a clumsy leaden counter used by boysin playing chuck farthing. [Eng.] Smart.",
    "DUMPINESS": "The state of being dumpy.",
    "DUMPISH": "Dull; stupid; sad; moping; melancholy. \" A . . . dumpish andsour life.\" Lord Herbert.-- Dump\"ish*ly, adv.-- Dump\"ish*ness, n.",
    "DUMPLE": "To make dumpy; to fold, or bend, as one part over another. [R.]He was a little man, dumpled up together. Sir W. Scott.",
    "DUMPLING": "A roundish mass of dough boiled in soup, or as a sort ofpudding; often, a cover of paste inclosing an apple or other fruit,and boiled or baked; as, an apple dumpling.",
    "DUMPY LEVEL": "A level having a short telescope (hence its name) rigidly fixedto a table capable only of rotatory movement in a horizontal plane.The telescope is usually an inverting one. It is sometimes called theTroughton level, from the name of the inventor, and a varietyimproved by one Gavatt is known as the Gavatt level.",
    "DUN": "A mound or small hill.",
    "DUNCE": "One backward in book learning; a child or other person dull orweak in intellect; a dullard; a dolt.I never knew this town without dunces of figure. Swift.",
    "DUNCEDOM": "The realm or domain of dunces. [Jocose] Carlyle.",
    "DUNCERY": "Dullness; stupidity.",
    "DUNCICAL": "Like a dunce; duncish.The most dull and duncical commissioner. Fuller.",
    "DUNCIFY": "To make stupid in intellect. [R.] Bp. Warburton.",
    "DUNCISH": "Somewhat like a dunce. [R.] -- Dun\"cish*ness, n. [R.]",
    "DUNDER": "The lees or dregs of cane juice, used in the distillation ofrum. [West Indies]The use of dunder in the making of rum answers the purpose of yeastin the fermentation of flour. B. Edwards.",
    "DUNDER-HEADED": "Thick-headed; stupid.",
    "DUNDERHEAD": "A dunce; a numskull; a blockhead. Beau. & Fl.",
    "DUNDERPATE": "See Dunderhead.",
    "DUNE": "A low hill of drifting sand usually formed on the coats, butoften carried far inland by the prevailing winds. [Written also dun.]Three great rivers, the Rhine, the Meuse, and the Scheldt, haddeposited their slime for ages among the dunes or sand banks heavedup by the ocean around their mouths. Motley.",
    "DUNFISH": "Codfish cured in a particular manner, so as to be of a superiorquality.",
    "DUNG": "The excrement of an animal. Bacon.",
    "DUNGAREE": "A coarse kind of unbleached cotton stuff. [Written alsodungari.] [India]",
    "DUNGEON": "A close, dark prison, commondonjon or keep of a castle, thesebeing used as prisons.Down with him even into the deep dungeon. Tyndale.Year after year he lay patiently in a dungeon. Macaulay.",
    "DUNGFORK": "A fork for tossing dung.",
    "DUNGMEER": "A pit where dung and weeds rot for manure.",
    "DUNGY": "Full of dung; filthy; vile; low. Shak.",
    "DUNGYARD": "A yard where dung is collected.",
    "DUNKER": "One of a religious denomination whose tenets and practices aremainly those of the Baptists, but partly those of the Quakers; --called also Tunkers, Dunkards, Dippers, and, by themselves, Brethren,and German Baptists.",
    "DUNLIN": "A species of sandpiper (Tringa alpina); -- called also churr,dorbie, grass bird, and red-backed sandpiper. It is found both inEurope and America.",
    "DUNNAGE": "Fagots, boughs, or loose materials of any kind, laid on thebottom of the hold for the cargo to rest upon to prevent injury bywater, or stowed among casks and other cargo to prevent their motion.",
    "DUNNER": "One employed in soliciting the payment of debts.",
    "DUNNISH": "Inclined to a dun color. Ray.",
    "DUNNOCK": "The hedge sparrow or hedge accentor. [Local, Eng.]",
    "DUNNY": "Deaf; stupid.[Prov. Eng.]My old dame Joan is something dunny, and will scarce know how tomanage. Sir W. Scott.",
    "DUNT": "A blow. [Obs.] R. of Glouc.",
    "DUNTED": "Beaten; hence, blunted. [Obs.]Fencer's swords . . . having the edge dunted. Fuller.",
    "DUNTER": "A porpoise. [Scott.] Dunter goose (Zoöl.) the eider duck. J.Brand.",
    "DUO": "A composition for two performers; a duet.",
    "DUODECENNIAL": "Consisting of twelve years. [R.] Ash.",
    "DUODECIMAL": "Proceeding in computation by twelves; expressed in the scale oftwelves.-- Du`o*dec\"i*mal*ly, adv.",
    "DUODECIMFID": "Divided into twelve parts.",
    "DUODECIMO": "Having twelve leaves to a sheet; as, a duodecimo from, book,leaf, size, etc.",
    "DUODECUPLE": "Consisting of twelves. Arbuthnot.",
    "DUODENAL": "Of or pertaining to the duodenum; as, duodenal digestion.",
    "DUODENARY": "Containing twelve; twelvefold; increasing by twelves;duodecimal.",
    "DUODENUM": "The part of the small intestines between the stomach and thejejunum. See Illust. of Digestive apparatus, under Digestive.",
    "DUOGRAPH": "A picture printed from two half-tone plates made with thescreen set at different angles, and usually printed in two shades ofthe same color or in black and one tint.",
    "DUOLITERAL": "Consisting of two letters only; biliteral. Stuart.",
    "DUOMO": "A cathedral. See Dome, 2.Of tower or duomo, sunny sweet. Tennyson.",
    "DUOTONE": "Any picture printed in two shades of the same color, asduotypes and duographs are usually printed.",
    "DUOTYPE": "A print made from two half-tone plates made from the samenegative, but etched differently.",
    "DUP": "To open; as, to dup the door. [Obs.] Shak.",
    "DUPABLE": "Capable of being duped.",
    "DUPE": "One who has been deceived or who is easily deceived; a gull;as, the dupe of a schemer.",
    "DUPER": "One who dupes another.",
    "DUPERY": "The act or practice of duping. [R.]",
    "DUPION": "A double cocoon, made by two silkworms.",
    "DUPLE": "Double. Duple ratio (Math.), that in which the antecedent termis double the consequent, as of 2 to 1, 8 to 4, etc.",
    "DUPLEX": "Double; twofold. Duplex escapement, a peculiar kind of watchescapement, in which the scape-wheel has two sets of teeth. SeeEscapement.-- Duplex lathe, one for turning off, screwing, and surfacing, bymeans of two cutting tools, on opposite sides of the piece operatedupon.-- Duplex pumping engine, a steam pump in which two steam cylindersare placed side by side, one operating the valves of the other.-- Duplex querela Etym: [L., double complaint] (Eccl. Law), acomplaint in the nature of an appeal from the ordinary to hisimmediate superior, as from a bishop to an archbishop. Mozley & W.-- Duplex telegraphy, a system of telegraphy for sending twomessages over the same wire simultaneously.-- Duplex watch, one with a duplex escapement.",
    "DUPLICATE": "Double; twofold. Duplicate proportion or ratio (Math.), theproportion or ratio of squares. Thus, in geometrical proportion, thefirst term to the third is said to be in a duplicate ratio of thefirst to the second, or as its square is to the square of the second.Thus, in 2, 4, 8, 16, the ratio of 2 to 8 is a duplicate of that of 2to 4, or as the square of 2 is to the square of 4.",
    "DUPLICATION": "The act or process of dividing by natural growth or spontaneousaction; as, the duplication of cartilage cells. Carpenter.Duplication of the cube (Math.), the operation of finding a cubehaving a volume which is double that of a given cube.",
    "DUPLICATIVE": "Having the quality of subdividing into two by natural growth.\"Duplicative subdivision.\" Carpenter.",
    "DUPLICATURE": "A doubling; a fold, as of a membrane.",
    "DUPPER": "See 2d Dubber.",
    "DUR": "Major; in the major mode; as, C dur, that is, C major.",
    "DURA": "Short form for Dura mater.",
    "DURA MATER": "The tough, fibrous membrane, which lines the cavity of theskull and spinal column, and surrounds the brain and spinal cord; --frequently abbreviated to dura.",
    "DURABILITY": "The state or quality of being durable; the power ofuninterrupted or long continuance in any condition; the power ofresisting agents or influences which tend to cause changes, decay, ordissolution; lastingness.A Gothic cathedral raises ideas of grandeur in our minds by the size,its height, . . . its antiquity, and its durability. Blair.",
    "DURABLE": "Able to endure or continue in a particular condition; lasting;not perishable or changeable; not wearing out or decaying soon;enduring; as, durable cloth; durable happiness.Riches and honor are with me; yea, durable riches and righteousness.Prov. viii. 18.An interest which from its object and grounds must be so durable. DeQuincey.",
    "DURABLENESS": "Power of lasting, enduring, or resisting; durability.The durableness of the metal that supports it. Addison.",
    "DURABLY": "In a lasting manner; with long continuance.",
    "DURAL": "Pertaining to the dura, or dura mater.",
    "DURAMEN": "The heartwood of an exogenous tree.",
    "DURANCY": "Duration. [Obs.] Dr. H. More.",
    "DURANT": "See Durance, 3.",
    "DURANTE": "During; as, durante vita, during life; durante bene placito,during pleasure.",
    "DURATION": "The state or quality of lasting; continuance in time; theportion of time during which anything exists.It was proposed that the duration of Parliament should be limited.Macaulay.Soon shall have passed our own human duration. D. Webster.",
    "DURATIVE": "Continuing; not completed; implying duration.Its durative tense, which expresses the thought of it as going on. J.Byrne.",
    "DURBAR": "An audience hall; the court of a native prince; a state levee;a formal reception of native princes, given by the governor generalof India. [India] [Written also darbar.]",
    "DURE": "Hard; harsh; severe; rough; toilsome. [R.]The winter is severe, and life is dure and rude. W. H. Russell.",
    "DUREFUL": "Lasting. [Obs.] Spenser.",
    "DURELESS": "Not lasting. [Obs.] Sir W. Raleigh.",
    "DURENE": "A colorless, crystalline, aromatic hydrocarbon, C6H2(CH3)4, offartificial production, with an odor like camphor.",
    "DURESS": "The state of compulsion or necessity in which a person isinfluenced, whether by the unlawful restrain of his liberty or byactual or threatened physical violence, to incur a civil liability orto commit an offense.",
    "DURESSOR": "One who subjects another to duress Bacon.",
    "DURGA": "Same as Doorga.",
    "DURHAM": "One or a breed of short-horned cattle, originating in thecounty of Durham, England. The Durham cattle are noted for theirbeef-producing quality.",
    "DURING": "In the time of; as long as the action or existence of; as,during life; during the space of a year.",
    "DURIO": "A fruit tree (D. zibethinus, the only species known) of theIndian Archipelago. It bears the durian.",
    "DUROMETER": "An instrument for measuring the degree of hardness; especially,an instrument for testing the relative hardness of steel rails andthe like.",
    "DUROUS": "Hard. [Obs. & R.]",
    "DURRA": "A kind of millet, cultivated throughout Asia, and introducedinto the south of Europe; a variety of Sorghum vulgare; -- calledalso Indian millet, and Guinea corn. [Written also dhoorra, dhurra,doura, etc.]",
    "DURST": "of Dare. See Dare, v. i.",
    "DURUKULI": "A small, nocturnal, South American monkey (Nyctipthecustrivirgatus). [Written also douroucouli.]",
    "DURYLIC": "Pertaining to, allied to, or derived from, durene; as, durylicacid.",
    "DUSE": "A demon or spirit. See Deuce.",
    "DUSK": "Tending to darkness or blackness; moderately dark or black;dusky.A pathless desert, dusk with horrid shades. Milton.",
    "DUSKEN": "To make dusk or obscure. [R.]Not utterly defaced, but only duskened. Nicolls.",
    "DUSKILY": "In a dusky manner. Byron.",
    "DUSKINESS": "The state of being dusky.",
    "DUSKISH": "Somewhat dusky. \" Duskish smoke.\" Spenser.-- Dusk\"ish*ly, adv.-- Dusk\"ish*ness, n.",
    "DUSKNESS": "Duskiness. [R.] Sir T. Elyot.",
    "DUST": "Coined money; cash. Down with the dust, deposit the cash; paydown the money. [Slang] \"My lord, quoth the king, presently deposityour hundred pounds in gold, or else no going hence all the days ofyour life. . . . The Abbot down with his dust, and glad he escapedso, returned to Reading.\" Fuller.-- Dust brand (Bot.), a fungous plant (Ustilago Carbo); -- calledalso smut.-- Gold dust, fine particles of gold, such as are obtained in placermining; -- often used as money, being transferred by weight.-- In dust and ashes. See under Ashes.-- To bite the dust. See under Bite, v. t.-- To raise, or kick up, dust, to make a commotion. [Colloq.] -- Tothrow dust in one's eyes, to mislead; to deceive. [Colloq.]",
    "DUST-POINT": "An old rural game.With any boy at dust-point they shall play. Peacham (1620).",
    "DUSTBRUSH": "A brush of feathers, bristles, or hair, for removing dust fromfurniture.",
    "DUSTER": "A blowing machine for separating the flour from the bran.",
    "DUSTINESS": "The state of being dusty.",
    "DUSTLESS": "Without dust; as a dustless path.",
