    "DUTCH": "Pertaining to Holland, or to its inhabitants. Dutch auction.See under Auction.-- Dutch cheese, a small, pound, hard cheese, made from skim milk.-- Dutch clinker, a kind of brick made in Holland. It is yellowish,very hard, and long and narrow in shape.-- Dutch clover (Bot.), common white clover (Trifolium repens), theseed of which was largely imported into England from Holland.-- Dutch concert, a so-called concert in which all the singers singat the same time different songs. [Slang] -- Dutch courage, thecourage of partial intoxication. [Slang] Marryat.-- Dutch door, a door divided into two parts, horizontally, soarranged that the lower part can be shut and fastened, while theupper part remains open.-- Dutch foil, Dutch leaf, or Dutch gold, a kind of brass rich incopper, rolled or beaten into thin sheets, used in Holland toornament toys and paper; -- called also Dutch mineral, Dutch metal,brass foil, and bronze leaf.-- Dutch liquid (Chem.), a thin, colorless, volatile liquid,C2H4Cl2, of a sweetish taste and a pleasant ethereal odor, producedby the union of chlorine and ethylene or olefiant gas; -- called alsoDutch oil. It is so called because discovered (in 1795) by anassociation of four Hollandish chemists. See Ethylene, and Olefiant.-- Dutch oven, a tin screen for baking before an open fire orkitchen range; also, in the United States, a shallow iron kettle forbaking, with a cover to hold burning coals.-- Dutch pink, chalk, or whiting dyed yellow, and used in distemper,and for paper staining. etc. Weale.-- Dutch rush (Bot.), a species of horsetail rush or Equisetum (E.hyemale) having a rough, siliceous surface, and used for scouring andpolishing; -- called also scouring rush, and shave grass. SeeEquisetum.-- Dutch tile, a glazed and painted ornamental tile, formerly muchexported, and used in the jambs of chimneys and the like.",
